R["oh__@tuvili"]="{['TS']=1725233343,['Version']=1773,['na']={[32]={['O']=19967,['N']='Alice in Wonderland',['C']=1.040000,['D']='A tribute to Alice in Wonderland; filled with little details from the books. A guild contest entry',},[81]={['O']=19967,['N']='Art & Trophy Gallery',['C']=1.030000,['D']='This is my interpretation of what the Gallery seems to be for: a museum.  I love collecting paintings, and keep them here, along with other fun stuff.',},[7]={['O']=19242,['N']='Black Vine House',['C']=1.022000,['D']='We offer a family-friendly place to get away from it all! Our domus is for the group that loves Games. The owner is a huge fan of Tales of Tribute, as you will discover, but all known Tamriel board games are represented, and pieces for games to invent your own. There\\'s a tent outside for the kids to play in, and the botanical wonders mean your eyes will never be bored. Our upstairs features everything you need for your stay: beds, bath, a well-stocked kitchen, and our cat to play with!',},[16]={['O']=19200,['N']='Daggerfall House',['C']=1.024000,['D']='One needs a water source to cook, and a fridge never goes awry. Three people live here; a papa, a mama, and a baby....',},[8]={['O']=19967,['N']='Romantic Getaway',['C']=1.022000,['D']='A contest build for a Love Nest. :)',},[29]={['O']=19967,['N']='Craft Studio & Home',['C']=1.025000,['D']='This house is a crafting studio, with living space upstairs',},[22]={['O']=19214,['N']='Laughing Moons House',['C']=1.002000,['D']='The theme is \"Enchantment\". I love my books, and I wanted to make a fabulous place to read, snack, and play with pets :)',},[63]={['O']=19104,['N']='New Life Snow Globe',['C']=1.004000,['D']='This is a small build for a guild contest, asking for a kiosk, to represent the trading guild we are.  The main tent is representative of a merchant tent in the SCA... but some banekin are taking advantage of the customers\\' presence....',},},['Key']='oh__@tuvili',}"
