R["oh__@webspinnerslies"]="{['Key']='oh__@webspinnerslies',['Version']=1773,['TS']=1724392599,['na']={[104]={['N']='Elegant Dunmeri Home',['O']=19958,['C']=1.051000,['D']='A beautiful, secluded getaway home built into the side of a cliff in the stunning Telvanni Peninsula. Sit and stay for a while :)',},[44]={['N']='Milethi Imports',['O']=19133,['C']=1.007000,['D']='House Hlaalu - Milethi Imports is the home and workplace of Kit Milethi, member of House Hlaalu, and owner of the Milethi Importation Company. Welcome, sera! Please pop in for a cup of tea, or sujamma if you prefer. All business inquiries are by appointment only. (Feel free to message me for RP). Snacks are greatly appreciated by Blossom the bantam guar, and Stimky Babby the cliff strider. Blessings of the Three be upon you.',},[6]={['N']='Cannibals\\' Den',['O']=19709,['C']=1.007000,['D']='There are rumors in the Necrom Outlaw Refuge of a cannibal who has taken up residence in one of the many abandoned rooms. Or maybe she\\'s just an antisocial Dunmer seeking solitude for her, her cat, and a large number of books. ',},[71]={['N']='Hla\\'ruhn Town',['D']='Welcome to Hla\\'ruhn, a little dunmer town located on the Bitter Coast. Off the trade route between Balmora and Gnisis, we invite you to visit our local tea house/bakery and spend a day wandering our quiet streets. \\nFeatures: The Tea House, smithy, alchemist, bank, and of course, the local Temple of the Three.\\nThis town is open for RP, events, visitors, etc. Please feel free to message me about hosting an event/private rp :) <3',['C']=1.041000,['O']=19958,},},}"
