R["oh__@djfriede"]="{['TS']=1724167298,['eu']={[104]={['C']=1.020000,['D']='The School of Magic welcomes all wizards and spellcasters. Only the best will be admitted, so prove yourself worthy. And maybe, after a hard day\\'s work of honing your skills, you can enjoy the sunset.\\n\\n(A large Ayleid and gothic inspired fortification along the coast.)',['N']='School of Magic',['O']=19916,},[81]={['C']=1.032000,['D']='A Cyberpunk themed city with narrow alleys, neon lights and machinery. ',['N']='Cyberpunk City',['O']=19714,},[90]={['C']=1.037000,['D']='Travellers seek out this sanctuary for some quiet and peace among the horrors. Formed around the fabled Heart of the Deadlands, the structure may well have been alive until it settled into stone.',['N']='Deadlands Cathedral',['O']=19955,},[49]={['C']=1.020000,['D']='20,000 Leagues Under the Seas: When Captain Nemo and his companions approached the long-lost city of Atlantis , they not only found it to be a place of knowledge and music -- but of ancient magic!',['N']='Lost City Atlantis',['O']=19446,},[70]={['C']=1.032000,['D']='My new master\\'s whisper beckoned me closer: \"Seeker, welcome to my realm, roaming through planes unknown to mortals. Gaze deep into the void and find answers to all you ask.\" -- Aeons have since passed. I hear my master\\'s distant laughter. One question remains unanswered: What\\'s wisdom\\'s worth, when I cannot leave?',['N']='Into the Void',['O']=19499,},[47]={['C']=1.032000,['D']='The Banker Assistant is running a little side gig: The Mad Man\\'s Machinarium. His newest robot creation is almost ready. So of course he has no time to clean up the place now! \\n\\n(An Apocrypha and clockwork styled robot factory built as intertwined spherical shapes.)',['N']='Mad Man Machinarium',['O']=19834,},},['Key']='oh__@djfriede',['Version']=1773,}"
