R["oh__@koalajack"]="{['Version']=1773,['TS']=1679846159,['eu']={[13]={['D']='Welcome to SnugForge, where the Industrial Arts are taken to a whole new level!  Here, we lovingly craft Orchid v2.0, our heavy cutting and welding construct. ',['N']='SnugForge',['C']=1.027000,['O']=19197,},},['Key']='oh__@koalajack',['na']={[55]={['N']='Koala\\'s Workshop',['O']=18745,},[45]={['D']='Immediate opening for an experienced chef at the esteemed Tel Galen estate and Bank of Vvardenfell branch office.  Our last chef went on a treasure hunt with one of the accountants and hasn\\'t returned  Must have an understanding of the refined Dunmer palate.  Bring your references and recipe book and inquire within.   As a side benefit, wages will be direct deposited to the bank.',['N']='Glowy Shroom Tower',['C']=1.021000,['O']=19029,},[42]={['N']='Formerly Archcanon\\'s',['C']=1.026000,['O']=18776,},[11]={['D']='Long ago, an experiment gone awry yanked the original Fargrave Mages\\' Guild Hall, and the adjacent bazaar, out of Oblivion.  An indeterminate time later, they appeared in Shadowfen.  Pay a visit to the Fargrave Enclave at The Ample Domicile and see for yourself.',['N']='Fargrave Enclave',['C']=1.020000,['O']=19442,},},}"
