R["gb__na__@thatonemedic__68"]="A Higher Elf (@glitterbrick),1653348516;Keevh-Xi (@Moreliaspilota27),1651202215;Stabbington Steele (@StabbityDoom),1651010029;"
R["fx__eu__@king_shadoweye__2"]="{['TS']=1653335191,['Version']=1767,['Effects']={[1]={['EffectType']=8502,['Contrast']=1.640000,['MetaData']={['title']='Week one - A new beginning.',['message']='A document of events of the brotherhood. By voralmo.\\n\\nA bleak and unfortunate time for us. An unknown, ancient room discovered under the sanctuary, containing some artifacts, most notably among them an aylied crown, a soul gem, a portal frame, (assuming to have deadra origins, assuming again, merunz dagon) and lastly of importance a cave dwelling flower plant.\\n\\nIt took several days for the affects of this plant to become known, it\\'s only so far known symptoms from witness accounts are: the constant feeling of being cold, and tired/sleepyness. With the end result being death if left untreated. There is as of yet only one known direct cure that was quickly created. (follow up with matron then, speaker now, alice for additional research) With the affects of the plage spreading so fast, there was unfortunately not enough time to create enough antidote, and many perished. The listener at the time included. The situation became dire, and we were forced to abandon the sanctuary. Sealing it off for as long as it takes. Something I believe to be a wise decision. \\n\\nThe remaining survivers regrouped in secret, and together fled, to a new sanctuary. It did not take long to settle in, everything we could have needed was there. (writers note: I can\\'t wait to read all those new books) \\nWith our passed on brothers and sisters laid to rest, and our walls knocked down, let this not be seen as a bad thing, for now the room to expand and rebuild better has come.\\n\\nOn the day of the new sanctuary opening, Speaker Vehk, became Listener. Matron Alice, became speaker. And plans for further sanctuaries have been made.',},['Pitch']=0,['SizeY']=30,['Z']=27300,['Roll']=0,['Alpha']=1,['Color']=81599,['SizeZ']=30,['Id']=1038,['X']=22394,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.209587,['Y']=20522,},[2]={['EffectType']=8502,['Contrast']=2.610000,['MetaData']={['title']='Week two - Dreaming Preperations.',['message']='A documentation of events of the brotherhood. By Voralmo.\\n\\nA few weeks prior to this events of day, some context:\\nsister \"horns\" as she is known, on first meeting, seemed odd, to say the least. One could sware she was affected by sheogorath. After some research and observation, it bacame clear that, that was true. One interaction, the first interaction, Lightning attempted to communicate with horns by the use of telepathy. Interaction one seemed to  possibly uncover some serious issues, as according to Lightning, horn\\'s mind seemed to be all over the place.\\nFollowing this, horn\\'s condition worsened increasingly from then on.\\nMany weeks later, her condition went from bad to worse, especially around more people at a time. Including strange incidents and things that we heard happening. And other times there appeared to be nothing wrong at all. Further increasing concern.\\n\\nOne day, her insanity became too much, and she tried to attack brother Jean. She was quickly restrained and secured by myself, and then taken to the bastion for better examination, as we knew something wasn\\'t right.\\nIt was revealed that a member of the morag tong had infiltrated her mind, controlling her actions and collecting her thoughts, as well as the mad god\\'s aflictions.\\nA plan has been devised to stop this and to save horns. To use an altered \"vermeana\\'s Torpor\" (a potion that allows someone, to walk within memories of another) to allow us to walk in horn\\'s memory and alter it, to remove the threat.\\nTo do this we traveled to an old cave used by verminena  worshipers, and a preast / alchemist, after some \"creative\" negotiations, created the Torpor we requested. With the added blessing of Merida, the torpor was altered for our spesific need. We believe.\\nSoon we delve into the mind to save our sister.',},['Pitch']=0,['SizeY']=30,['Z']=27250,['Roll']=0,['Alpha']=1,['Color']=135899,['SizeZ']=30,['Id']=1039,['X']=22353,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.216568,['Y']=20526,},[3]={['EffectType']=8502,['Contrast']=1,['MetaData']={['title']='Week three - The dreaming mind of mazes',['message']='Documentation of events of the brotherhood. Written by Voralmo.\\n\\nUsing the pototion we aquired from the previous venture (an altered version of verminas torpor), each of us who decided to make the trip into horn\\'s mind, took a small amout of the potion, and drifted to sleep. As previously planned, Lady Yasnar, connected each of us to herself through her telepathy, and then connected us to sister horn\\'s mind, allowing us to enter her mind to remove the threat.\\n\\nWhen in mental world space, the ideas of reality and logic is something that should be quickly forgotten. The world appearing before us took all shapes and sizes, all ideas and flaws. ever static and changing, ever logical and illogical. From examination the world was creating shape from what could be seen as memories, and also likely emotions.\\nThe dream space consited of puzzles that created themselfs that we had to find and work out, to continue further. Many of the puzzles solved were indeed solved by group collective efforts. As well as traps that had been placed to throw people off and to trap those within.\\n\\nAfter working through the maze, we found our selfs face to face with horns herself, in her own protective area guarding all the information that the intrucive force we set out to eliminate was trying to get.\\nWe believe we were able to eliminate the morag tong agent within horn\\'s mind, thus bringing her back to her normal self, and returning her to us in the real world.\\n\\nAlso on this day, Silencer skiri, became matron. \\nSagira has become obsessed with gravel. And... I think speaker Orbeas had something to tell me? - note to self, check on this.\\n',},['Pitch']=0,['SizeY']=32,['Z']=27194,['Roll']=0,['Alpha']=1,['Color']=239948,['SizeZ']=32,['Id']=1045,['X']=22313,['SizeX']=27.456456,['Groups']=0,['Yaw']=2.216568,['Y']=20524,},[4]={['EffectType']=8502,['Contrast']=2.500000,['MetaData']={['title']='Week fore - Rumours above',['message']='A documentation of events. Written  by Voralmo.\\n\\nTo surprise, everything was relativly calm recently. No major threats, nothing too out of the ordinary. Freeing up some time to work on my research. \\nAlthough I am absolutly sure speaker Orbeas had something to tell me? I just can\\'t put my finger on it....\\nHowever, just above us rumours begin to gather in the heart of Kavatch. A well known noble has vanished from the heart of the city.\\nAs a result of this, false rumours started to spread that the brother hood was the cause, and a further result, more attention was directed at us, and talk of searches started to take flight.\\nThis we could not allow. And so we did not.\\nWe turned the tables and collaped these rumours on themselfs. Some who spoke of the brother hood being the cause, met a kind fate, and vanished. Others, were met with a more entertaining fate. They were forced into insanity, and now they worship the almighty lord of potatos. All hail the potatos! \\nNo one will be taking them seriously now. On top of this evidence has been left to suggest that the order of the hour was responsible for the fate of the late vanished noble. - The Matron turned out to be the cause in the end.\\n\\nWith the extra time, I can start working on my project. I shall be exporing different worlds and try to replicate a process from long ago, in an attempt to find the realm my daughter came from. Some tests have already begun. And have been better documented in my study, but leave reference here as a part of events.\\nSo far all tests have been unsuccsesful and results have been random.\\n\\nWith these results appearing to be truly random, the amount of time this could possibly take could be infinate...',},['Pitch']=0,['SizeY']=30,['Z']=27139,['Roll']=0,['Alpha']=1,['Color']=699926,['SizeZ']=30,['Id']=1048,['X']=22273,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.230531,['Y']=20524,},[5]={['EffectType']=8502,['Contrast']=3.540000,['MetaData']={['title']='Week five - Unforseen betrail.',['message']='Documentation of events seen by the brotherood relayed to and then writen by Voralmo\\n\\nLatest events have proven to be most unexpected. During a gathering Sister Gwyn seemed very distressed, believing brother lock was in trouble based off their last encounter, and that no one had seen Lock in some time since. The brotherhood pulled everything together, lock asking about the skeliton key not long before, stating that he would find it to help Sister Ariel. As well as not believing Nocternal would do what she did to the brotherhood much time prior.\\n\\nA crytpic note from lock was also found in the sanctuary waters, unsure of it\\'s true meaning we decided to act.\\n\\nFollowing this trail of clues, founding our selves at, in fairness a very likely place to look, at the door steps to Lock\\'s home in Marbuck, we invited ourselfs in where some facinatingly disturbing discoveries were made.\\n\\nSeveral notes were recorded to have been found within his home heavily sugesting that lock had been having dreams of evergloam, and started to hear a womans voice in his head increasingly over time, that of nocternal. Deciding to look for leads, finding a place to reach evergloam from within the clock work city. Although just before entering the city, nocternal lead him to an oil field, to reclaim a blade, as a gift to lock. Including the offer of a deal, in exchange for retrieving and protecting the skeliton key, he could use its power every so often. He appears to have been unsure to take the deal or not.\\n\\nAlong side this, a portal was found within his home that was connected directly to Evergloam - The realm of Lady luck herself. Nocternal, the cause of so many problems and horrors of the past. One who we could described as our sworn enemy.\\n',},['Pitch']=0,['SizeY']=30,['Z']=27087,['Roll']=0,['Alpha']=1,['Color']=194999,['SizeZ']=30,['Id']=1056,['X']=22234,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.209587,['Y']=20526,},[6]={['EffectType']=8502,['Contrast']=3.100000,['MetaData']={['title']='Week six - A well paid invasion',['message']='A documentation of witnessed events relayed by Speaker Orbeas and partly seen, and written by Voralmo\\n\\nThe listener was given word, passing it onto speaker Velyna of a contract the brotherhood had recieved, turning out to be very unique, and we were paid in a such a volume a merchant lord would have droped a jaw.\\n\\nWe were to meet with a thalmor investigator by the name of Aurenya, \\nwho planned out a creative and extencive contract plan. As to why we do not know, but she was Disgusted with the way the Dominion was preforming, and planned to make a correction herself by wiping the slate clean - \\n\\nOver several other dominion activites, investigator Aurenya collected Covenant uniforms, for use to ware and stage a fake invasion on the aldimery college of aldimeri propriety to eliminate all the thalmor officers there, and to blame the mass deaths on the Covenant.\\n\\nHowever there were two conditions for our task. \\nOne: To leave the recruits alive unless they fought back\\nTwo: To leave someone known as Firisar alive in particular\\n\\nThe well created plan by the investigator went well, with one serious complication. Duriung the slaughter, sister Natanii failed to take note of the second condition, and killed Firisar.\\n\\nSister Natanii collected Firisar\\'s personal affects and returned them to the invesitgator, who was greatly annoyed by the failure.\\nUpon covering our tracks and a safe return to the sanctuary, Sister Natanii has been punished.\\n\\nAlso on this day, we open our new Dominion territory sanctuary. Long may it stand, hidden in plain sight among the elvin architecture.\\nI look forward to seeing myself spending much time there.',},['Pitch']=0,['SizeY']=30,['Z']=27008,['Roll']=0,['Alpha']=1,['Color']=969599,['SizeZ']=30,['Id']=1062,['X']=22176,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.230531,['Y']=20526,},[7]={['EffectType']=8502,['Contrast']=3.300000,['MetaData']={['title']='Week seven - Training and... punishment?',['message']='A documentaation of events of the brotherhood. Written by: Unknown\\n\\nThe events of this week truly amaze and confuse. For today we were subjected to harsh training. \\nWere we lacking any skills? were we out of shape? were we not meeting up to standards? I wouldn\\'t of said so. None of us would have said so.\\n\\nYet the failure of last week, the death of a civilian that was not a target by sister natanii, could have been the motive for the.... punishment training. To make sure we did our jobs right? Either way it didn\\'t make sense.\\n\\nwhile we were undergoing our harsh routine, sister Natanii was served a full course meal? Of all things...\\n\\nThrough out our training, Natanii was well looked after, and was treated like royalty.\\n\\nI am starting to think that the speakers may have lost their minds. We are being punished for a mistake that not only we didn\\'t do, but the person who actually messed up was being rewarded?\\n\\nThis has been the most illogical week I\\'ve ever seen. And I\\'ve seen a bear waring a netch cap.',},['Pitch']=0,['SizeY']=30,['Z']=26961,['Roll']=0,['Alpha']=1,['Color']=201799,['SizeZ']=30,['Id']=1063,['X']=22137,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.251475,['Y']=20527,},[8]={['EffectType']=8502,['Contrast']=4,['MetaData']={['title']='Week eight - A Tong twisting theft',['message']='Documentation of events of brotherhood members. Writen by: Unknown\\n\\nNothing out of the ordinary. A normal day. A normal every day contract for us to complete in the region of Deshaan.\\nFind the target... watch and plan... eliminate... \\nFind the target... watch and plan... eliminate...\\nFind the target... watch and plan... eliminate...\\nJust like every other contract before us. \\n\\nOr so we thought it was going to be.\\n\\nIt seems this time we were not the only hunter stalking the prey.\\nRight from under our noses, a blasted agent of the Morag Tong was some how able to sneak in and take out the target just before we got to them. How could they have known?\\nThe breif encounter with this agent was even more concerning. The Tong agent had the audacity to tell us that we were in their territory! In stone falls of all places! Fortunatly however this encounter did clue us to the Morag Tong\\'s growing presence at lelast within Deshaan, and this will be their un-doing.\\nWith little left to do within Stone falls considering our kill was stolen from us, we headed back to the sanctuary to contemplate our next actoins and formulated a plan. \\nThe first step, to infiltrate the ranks of the Morag Tong. To place one of our own on the inside to take part as an important cog like in the masterfully created dwarven machines, to aid in future plans.\\n\\nAfter completing this first step, we will gather again and plan our next motion of actions.\\nIf the Morag Tong thought we would stand by idle while they took \"territory\", or if we would allow a contract to be stolen from us, practically from right infront of us, then they are very, very mistaken. \\nWe will deal many blows to the Tong for all they have done to us.',},['Pitch']=0,['SizeY']=30,['Z']=26911,['Roll']=0,['Alpha']=1,['Color']=187999,['SizeZ']=30,['Id']=1065,['X']=22100,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.251475,['Y']=20530,},[9]={['EffectType']=8502,['Contrast']=1.820000,['MetaData']={['title']='Week nine - Spilled knowledge',['message']='A written acount of events witnessed by the brotherhood. Written by: Unknown\\n\\nAnother curious contracter approached us, at first you would assume he was a typical mage, uses magic, slightly derranged, a little crazy and thought himself above most. However, on this occasion the mage was a devoted follower of the Deadra of secrets and knowledge its self, Hermaous Mora, the ruler of the relm of Aprocifa.\\n\\n It took a little time for the reason of our services to become apparent but after some inquisitive questioning from the derranged man, we discovered that he recieved word, that one of the members of his own order that worship Hermaous Mora, freely exchanged dwemer secrets for knowledge on argonian death practices. It was made clear to us that it was a breach of thier rules and the brotherhood was hired to discover out of three suspects, who the culprit was, and to end the culprit there and then. The plan: To enter the pocket demension of the Hermaous worshipers by teleport thanks to our contractor, and to pose as iniciates for the Apocrapher order to avoid suspision and grant us access to the suspects. Upon entering we were greeted by three established, and suspect members, and soon after we got to work. \\n\\nEach of us closly followed our suspects under the illusion of wanting to learn about the ways of their order, while we conducted our careful investigation of subtle questions and searching.\\n\\nAfter much time, we belive we worked out who the culprit was, a high elf, who recently \"procured\" volumes on argonian culture. And after refusing to tell where these volumes came from and what they cost, the evidence reached acceptible levels to us and our contractor, and the culprit was ended.\\n\\nAlthough.. due to how the situation unfolded, we could not truly confirm the culprit.',},['Pitch']=0,['SizeY']=30,['Z']=26859,['Roll']=0,['Alpha']=1,['Color']=309964,['SizeZ']=30,['Id']=1072,['X']=22059,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.223549,['Y']=20531,},[10]={['EffectType']=8502,['Contrast']=2.970000,['MetaData']={['title']='Week ten - wispers and family (Part A)',['message']='A written document of events by the brotherhood. Written by: Unknown\\n\\nSurprisingly it had been calm over the last week, although some excitement came our way. In an anouncement presented by the matron, it seems at least for the last couple of weeks, the matron has been hearing un-natural wispers, that of maphala. \\n\\nIn a search for awnsers, Matron Skiri and her sister Ophelia, tracked down and captured a retired Morag Tong agent named Raalnil. Who was also their farther.\\n\\nThrough a small array of portals, we traveled to the Matron\\'s personal pocket realm, where her farther was being held, and the answers to our own questions were met with no less than obscure answers. Other than that Raalnil seemed to have not expected how things would turn out, and he thought his daughters would be safe and treated well.\\n\\nIn the end we decided to use a spell, to project Raalnil\\'s memories into a vision for all of us to get some answers, and to take a look into the past to see what happened long ago.\\n\\nThe vision showed us Raalnil, the farther, and Nyrelia, the mother. Were both concerned one evening. Nyrelia confessed to being a dedicated follower of maphala. which explains the link between skiri and the wispers, as it seems some of the traits passed onto her. It was also shown to us, that Raalnil made a deal, and sold his only two daughters to house dress, foolishly trusting that they will be safe and treat them both like royalty. In exchange for a place of membership within the Morag Tong, not only not keeping tabs to make sure his daughters were okay, but to the distress of Nyrelia who was unaware of the deal intill is was too late.\\n\\nalso within the vision, we saw a hint as to where Nyrelia may have gone. A shrine to mephala, hidden within a grotto in stonefalls.',},['Pitch']=0,['SizeY']=30,['Z']=26801,['Roll']=0,['Alpha']=1,['Color']=999944,['SizeZ']=30,['Id']=1075,['X']=22019,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20530,},[11]={['EffectType']=8502,['Contrast']=2.660000,['MetaData']={['title']='Week ten (Part B)',['message']='Upon entering the grotto, the Matron pulled off her head, insead of her hood, in a freak typo accident. Fortunatly a mirical happened and the Matron\\'s head was in perfect condition shortly after on her neck, and her hood was removed instead.\\n\\nThe wispers lured the matron to the statue, where a body, that appeared to be the Matron\\'s mother lay. The voice offered a choice. Face death or join her. In reaction the Matron threw the busts of Mephala\\'s champions off the bridge and toppled the Mephala statue with her Vampire lord form breaking free of mephala\\'s grasp. For now...\\n\\nReturning to the sanctuary, Speaker Midd was no where to be found, vanishing with out a word or trace. We hope for his safe travels.',},['Pitch']=0,['SizeY']=30,['Z']=26768,['Roll']=0,['Alpha']=1,['Color']=999528,['SizeZ']=30,['Id']=1076,['X']=21997,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20530,},[12]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='Week eleven - A calming mass murdering (Part A)',['message']='A document of written events by the brotherhood, written by: Unknown\\n\\nWas there an invasion coming? Was the sactuary about to be found? Did a contract go wrong? Or perhaps did someone mess up their contract? Did anyone break any rules or was there some form of chaos about to take place?\\n\\nNope. Nothing at all. Thank Sithis for giving us a peacful gathering for a change.\\n\\nIt has been many a long days since we had the chance to simply catch up with eachother, to eat, drink, sit, and relax. We can\\'t allow our selves to get used to this though, that could be eaqually disasterous. While gathered with everyone, all of us began to draw out attention back to the Morag Tong. Still ever curious as to how they beat us to our target.\\n\\nMany ideas were suggested, perhaps the contractor gave us and the Morag Tong the contract. Maybe we were followed... or maybe information was sliped to them in another manner, to name some suggestions. Fortunatley we do not have any reason to suspect any of our own... for now.\\n\\nWhile we were at it, we also came up with some ideas to catch out the Morag Tong, and possibly cripple them. From creating dummy contracts to see if we can draw them out to see if they try to steal the kill once more, to finding their supply routes and tampering with their food over time, as well as searching Morrowind to see if we can take the fight to them. For the time being however we must still remain cautious and must take extra caution when traveling to Morrowind, to avoid any suspision.\\n\\nAs a treat to cool off, the speakers presented to us a contract that had come in, that named all of the citizens within Dragonstar to be claimed by Sithis. So the speakers decided to open a portal and shove us all though to our mass murder treat.',},['Pitch']=0,['SizeY']=30,['Z']=27318,['Roll']=0,['Alpha']=1,['Color']=94099,['SizeZ']=30,['Id']=1077,['X']=22381,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20461,},[13]={['EffectType']=8502,['Contrast']=2.780000,['MetaData']={['title']='Week eleven (Part B)',['message']='In my opinion the real bonus was that we didn\\'t have to crouch to get through speaker Alice\\'s portal. We had our fun, and returned home.\\n\\nSomething quite stange was sighted this week however, a hooded monk? in kavatch in ocean blue robes with gold lining, complete with an eye on the front. He was walking around, randomly asking people \"I am sure you had soemthing to tell me? But I am not sure what it was\". If that was some code or secret message I have no idea. The elf seemed crazy to me.',},['Pitch']=0,['SizeY']=30,['Z']=27285,['Roll']=0,['Alpha']=1,['Color']=83199,['SizeZ']=30,['Id']=1078,['X']=22358,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20461,},[14]={['EffectType']=8502,['Contrast']=1.810000,['MetaData']={['title']='Chronicle vualt',['message']='Welcome Voralmo\\'s personal warded, pocket demension, the Chronicle vualt.\\nA place where even hermayous mora can only dream of learning what is inside. \\n\\nAs a psijic mage / monk, it is second nature too make a document of all important events that take place that may need to be looked back on.\\n\\n(Please excuse any bad grammer, incorrect spelling, or general bad sentences, etc.)\\n\\nThis vualt contains: Stories from -\\nYear 1 - complete\\nYear 2. - in progress',},['Pitch']=5.277876,['SizeY']=30,['Z']=26833,['Roll']=0.050615,['Alpha']=1,['Color']=995430,['SizeZ']=30,['Id']=1079,['X']=22347,['SizeX']=26.456456,['Groups']=0,['Yaw']=0.645772,['Y']=20187,},[15]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=0,['SizeY']=510,['Z']=26563.734258,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=510,['Id']=1083,['X']=22126.686027,['SizeX']=700,['Groups']=0,['Yaw']=3.794346,['Y']=20314,},[16]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=0,['SizeY']=473,['Z']=27074,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=473,['Id']=1084,['X']=22119,['SizeX']=802,['Groups']=0,['Yaw']=5.358161,['Y']=20280,},[17]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=1.570971,['SizeY']=790,['Z']=26873,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=790,['Id']=1085,['X']=22390,['SizeX']=700,['Groups']=0,['Yaw']=0.698132,['Y']=20560,},[18]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=6.258751,['SizeY']=550,['Z']=26667,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=550,['Id']=1086,['X']=22624,['SizeX']=800,['Groups']=0,['Yaw']=5.372123,['Y']=20300,},[19]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=0.331613,['SizeY']=142,['Z']=26591,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=142,['Id']=1087,['X']=22161,['SizeX']=698,['Groups']=0,['Yaw']=0.628319,['Y']=20556,},[20]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=0.443314,['SizeY']=172,['Z']=27013,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=172,['Id']=1088,['X']=22126,['SizeX']=860,['Groups']=0,['Yaw']=2.206096,['Y']=20520,},[21]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=1.553343,['SizeY']=690,['Z']=26835,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=690,['Id']=1089,['X']=22354,['SizeX']=940,['Groups']=0,['Yaw']=2.220059,['Y']=20061,},[22]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=6.248279,['SizeY']=610,['Z']=27317,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=610,['Id']=1090,['X']=22443,['SizeX']=220,['Groups']=0,['Yaw']=3.780383,['Y']=20361,},[23]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=0.027925,['SizeY']=190,['Z']=27147,['Roll']=0,['Alpha']=1,['Color']=996959,['SizeZ']=190,['Id']=1092,['X']=22633,['SizeX']=840,['Groups']=0,['Yaw']=3.808308,['Y']=20501,},[24]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=6.237807,['SizeY']=450,['Z']=27027,['Roll']=0.013963,['Alpha']=1,['Color']=996959,['SizeZ']=450,['Id']=1093,['X']=22808,['SizeX']=260,['Groups']=0,['Yaw']=3.830998,['Y']=20221,},[25]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=5.731661,['SizeY']=210,['Z']=27246,['Roll']=2.281145,['Alpha']=1,['Color']=996959,['SizeZ']=210,['Id']=1094,['X']=22534,['SizeX']=80,['Groups']=0,['Yaw']=2.666863,['Y']=20381,},[26]={['EffectType']=901,['Contrast']=1,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Pitch']=5.787512,['SizeY']=230,['Z']=27083,['Roll']=1.061160,['Alpha']=1,['Color']=996959,['SizeZ']=230,['Id']=1095,['X']=22723,['SizeX']=100,['Groups']=0,['Yaw']=3.876376,['Y']=20371,},[27]={['EffectType']=8502,['Contrast']=3.140000,['MetaData']={['title']='Week twelve - A stringing of killing',['message']='A document of events of the brother hood. Written by: Unknown\\n\\nA contract came to us from the speakers, a light assignment with some usual odd twists. A contract, to meet with a street preformer by the name of \"Daring\" in the city of Lilandrill within the summerset isles. If I remember correctly there were ruhmours of some of the things that happened there last and it didn\\'t end well... this I pray wont be a repeat of the \"out of control mass murder\".\\n\\nAfter some searching we found our preformer. Juggling knives with much skill. While watching the preformance, letting our precence known, \"Daring\" sliped us a letter. Within, spoke of someone by the name of \"Urena\", who learned of a hidden area and access to it owned by the sapriarchs, and for that reason they had to forfit their hart beat. Also, that the target had further information on them about a second set of targets that also needed to be eliminated.\\n\\nWe found Urena working in the inn within the city. We also found what appeared to be an importer of Listener Vehk. The sighting was reported to the black hand on our return. After bribing the other residence around to leave, luring her to a room upstairs, dealing with her acordingly, the classic \"shove them in a closet and clean it up later on when its quiet\" method. On her body we found another letter, within followed more instructions, that all the people within the Kinlady\\'s mansion, within the city, were to die. We traveled there, and left no survivers to tell the tale.\\n\\nHowever while on guard at the door to the kinlady\\'s mansion, I am sure I saw that crazy monk or mage again in the city. Same robes, same elf... I am eaither losing my mind or it\\'s a complete coincidence. Everyone else seems to think I saw a \"Psijic\"? after I described it... what do I know though.',},['Pitch']=0,['SizeY']=30,['Z']=27244,['Roll']=0,['Alpha']=1,['Color']=889199,['SizeZ']=30,['Id']=1115,['X']=22324,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.218313,['Y']=20463,},[28]={['EffectType']=8502,['Contrast']=2.700000,['MetaData']={['title']='Week thirteen - following a lead, or the lead following you?',['message']='Document of events witnessed by the brother hood. Written by: Unknown\\n\\nInvestigations on the Morag Tong have proven fruitful and have taken us back to Deshaan, following a lead, being the contractor that gave us the contract that was stolen from us a few weeks prior by the Tong. Re-finding \"Tenulu Adrori\" the original contractor, was a simple enough task, not far east of the small settlement Vale of the ghost snake. If the Tong operate are truly operating here, we can\\'t be too caution can\\'t be thought of likely. While on watch from afar, I thought I saw a monk dressed in blue robes again... but I can\\'t be certain this time, maybe im losing my mind. \\n\\nAfter some more inquisitive interogation, we discover that a group of dunmmer had recently arrived in the area with some merchants. Too coincidental, and something worth investigating. We also learn the origin of our contract. Acting out of vengence, the betrail of her beloved, Viruse, wedding another, and spreading rumours about her that caused her banishment.\\n\\nDespite all these people who could have known of our contract, apparently all those who could have possibly known about the contract are dead. Rather convenient huh?  Either way, uppon offer we decided to follow Tenulu Adrori to the ritual site where the sacrement was preformed. It may have been a ritual site, but a daft place to preform the sacriment. You would think that when contacting us, you would be at least some what shecluded? or hidden away? Instead of at a shrine in the open wilderness that must be known about by several others. After some searching, that idea became rather obvious. Several dead bodies were found around the surrounding area, as well as light footprints trailing off into the wilderness. The type of foot print left by a fellow asassin...',},['Pitch']=0,['SizeY']=30,['Z']=27200,['Roll']=0,['Alpha']=1,['Color']=171499,['SizeZ']=30,['Id']=1158,['X']=22292,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.169444,['Y']=20462,},[29]={['EffectType']=8502,['Contrast']=3.300000,['MetaData']={['title']='Week thirteen (Part B)',['message']='the Morag Tong... which could explain how our contract was stolen from us. finding everything we had to find at the shrine, setting off following the faint foot prints was no easy task, but took us to a merchant caravan. It took little to bring forth their co-operation. We searched through their goods, finding a series of notes and messages all written in a cryptic code, the merchants were in no position to argue with us taking them... ha ha ha. \\n\\nWe left Tenulu Adrori alive, and headed home. Will the cyphers reveal anything on the Tong? is yet to be discovered...',},['Pitch']=0,['SizeY']=30,['Z']=27173,['Roll']=0,['Alpha']=1,['Color']=121299,['SizeZ']=30,['Id']=1159,['X']=22273,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.318018,['Y']=20462,},[30]={['EffectType']=8502,['Contrast']=2.870000,['MetaData']={['title']='Week forteen - The code games',['message']='A document of events by the brotherhood. Written by: Unknown\\n\\nOur objective, to de-cypher the coded messages assumably written by the Tong that were recovered at a dunnmer merchant caravan. We teleported to a smaller sanctuary in west skyrim where our recovered coded messages from Deshaan were being held and worked on.\\n\\nMany, many a blazing hours were spent arched over staring at those infernal papers, it would seem at first there would be no end...\\n\\nHour by hour, we started to make things clear. Word by word, the puzzle became clear.\\n\\nWhere finally, after many hours of mind exuasting work, we made a breakthrough, and everything fell into place. Placing all the decrypted messages together, in no particular order they read:\\n\\n\"Excellent work. Finish this \"Viruse\", and make sure the Brotherhood gets the message. Next dead-drop at Hlaani\\'s Hovel.\"\\n\\n\"Our agents have run into the Brotherhood before in these parts but they shouldn\\'t pose a problem. Keep establishing our foot-hold, keep your ears to the ground. Any correspondence from now on will be through dead-drops only.\"\\n\\n\"RA. When I said get in with the locals I did not mean it literally. You are being relocated to Narsis to avoid any further... incidents.\"\\n\\n\"Have established contact with House Hlaalu. Requesting another shipment of scrib jerky and ash-yams. Pretty please?\"\\n\\n\"A suitable safe-house has been established. The benefactor you put me in touch with proved most helpful. -RA.\"\\n\\n\\n\\nFrom this infomation, our next move will be to investigate and search for \"Hlaani\\'s Hovel\", find the remaining dead-drop locations, and leave no stone unturned for Morag Tong within Narsis.',},['Pitch']=0,['SizeY']=30,['Z']=27132,['Roll']=0,['Alpha']=1,['Color']=248699,['SizeZ']=30,['Id']=1170,['X']=22241,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.218313,['Y']=20463,},[31]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='Mini event between week 14 and 16 - Covert code',['message']='Written by: Dathear\\n\\nMy mission from the speakers, a covert mission to act on the coded letters we took and decrypted. To travel back to Deshaan, to Narsiss, to discover who R.A. was, who they met with, and where they travel. To report back everything to the black hand.\\n\\nArriving in Narsiss, some light strolling lead me to a possible suspect, and after hearing a remark about being \"hired to kill beggers\", but they wouldnt because they \"were on duty\", confirmed suspisions. However There was a complcation. After hearing them mention eachothers names in greeting, the prime suspect, \"Rilndur\", met with a new suspect, \"River\", who both met with \"Raleth\".\\n\\nThree possible R for \"R.A.\", what rotten luck. At first sightings, \"Rilndur\" gave a folder to a contact he called \"Vim\" and then went over to the market stalls, shortly meeting \"river\" after woulds. Not long after that, the pair met with \"Raleth\". River handed Raleth a package, confirming is was for Halaau. Also, River sliped one of the market stall holders a letter, after Rilndur stole something earlier. What this letter or prior mentioned package contained in unfortunatly unknown.\\n\\nRaleth did not return after taking the packageto halaau, but this Rilndur and River continued to talk, and spoke of a place where one of them was staying in the area, and both agreed to head there. They left the market, and headed around the side of a house, trying to be as descreat as possible. Losing sight of them, as they climbed over the garden wall of the large house on the market tier.\\n\\nI believe I have all the infomration I need, I shall report to the hand immediatly.',},['Pitch']=0,['SizeY']=30,['Z']=27089,['Roll']=0,['Alpha']=1,['Color']=339919,['SizeZ']=30,['Id']=1186,['X']=22211,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.211332,['Y']=20464,},[32]={['EffectType']=8502,['Contrast']=2.960000,['MetaData']={['title']='Week fifteen - A family meal, never again...',['message']='A document of events by the brother hood. Written by: Unknown\\n\\nAfter all the stress of late, the tong, missing members, following leads, it was time to take a moment to sit down and enjoy a meal. What could go wrong? Well, the \"experiment went as planned\".\\n\\nIt felt odd from the start, we may be a family, but us sitting down for a meal? us? There is a first for everything I guess, and a last personally. The effort that had been put into this meal gathering was quite extencive. From the wood elfs of the green pact to the high end tastes found in summerset, there was something for everyone and no one could possibly feel left out. It truly was all to easy, and why should we have suspected anything... oh how little we knew.\\n\\nWe tucked into our meal. Credit to the cooks, mighty fine food cooked to perfection, But then it hit us, one by one we hit the floor. Waking up, in a house, that even sheo himself would be impressed by. A most crazy host that made no sense to start. As we traveled in further, the chandeliers started to tilt to unnatural directions, for gravity was pulling the room the other way. Soon we found ourselfs feeling like we were mealting yet no heat in sight, the obscurity of shooting lasers from our eyes! the rooms started to flip as we found ourselfs walkig upside-down! Portals to unknown places! The screaming! The obserdities! The courpses! Had sheo entered my mind?!\\n\\nWe woke up... all of us were in strange places dotted about the sanctuary. We woke refreashed... and truamatized... We gathered to try to make sense of what we just witnessed. To discover Sister Dee had put something in our food to see what would happen.\\n\\nUnrest and uncertainty now spreads within the brotherhood. With the keeper questioning disapline and security.\\n\\nFamily meal? NEVER AGAIN!',},['Pitch']=0,['SizeY']=30,['Z']=27048,['Roll']=0,['Alpha']=1,['Color']=997144,['SizeZ']=30,['Id']=1187,['X']=22180,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.197370,['Y']=20463,},[33]={['EffectType']=8502,['Contrast']=2.960000,['MetaData']={['title']='Week sixteen - Our turn',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nOver the past weeks, much progress has been made reguarding the Tong, and our several individual covert missions have proven even more fruitful. Narrowing down our suspects of \"R.A\" to Rilndur Aretonyl, and River Avani.\\n\\nDiscovering a possible informat \"Vim\", but is yet to be confirmed and unfortunatly we believe the tong are aware we have intercepted their messages, and have likely reinforced the town by now. Although we have discovered the location of two dead drops, that will now become our first target, and report what we find. Aswell their hide out, our second target after we met back in Narsiss.\\n\\nWe headed to Narsis via Speaker Alice\\'s portal. It couldn\\'t have felt more static-y. Traveling with fox and Speaker Alice to Lake Hlaalu, the first dead drop, on constant guard. Searching and finding sets of notes appearing to be written by \"R.A\" explaining to \"stop using dead drops\", written by the same hand as the coded letters, but not in code. And a map of Deshaan. We promptly took these findings with us, while heading back to Narsiss to met back with the others when they finished with the other dead drop.\\n\\nMeeting back up, we proceded to stage two, the hide out. We tried the front door but no one answered, so we went around to the garden wall where we witnessed them jumping over prior. Heading inside from the garden, we met River Avani, we offered to take her in peacefully, but refused to co-operate, for River had the high ground! Although we \"[tried] it\" and River was promptly caught off gurard and dealt with by our Matron and paralized, taking her prisoner. Searching her body, finding a few vials of poison, and a hidden note, of very personal love desires. The house, contained an odd passageway in the ',},['Pitch']=0,['SizeY']=30,['Z']=27008,['Roll']=0,['Alpha']=1,['Color']=105199,['SizeZ']=30,['Id']=1188,['X']=22150,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20466,},[34]={['EffectType']=8502,['Contrast']=3.250000,['MetaData']={['title']='Week sixteen (Part B)',['message']='basement, leading to an old farm house, and upstairs, a map of stonefalls and deshaan.\\n\\nFinding everything we could, we headed through the passage in the basement, and met back up with Spaeker alice in town. Who opened a portal and took us home. Where we placed River, in our cells for further questioning, but what will make her talk?',},['Pitch']=0,['SizeY']=30,['Z']=26979,['Roll']=0,['Alpha']=1,['Color']=105199,['SizeZ']=30,['Id']=1189,['X']=22129,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.223549,['Y']=20466,},[35]={['EffectType']=8502,['Contrast']=2.880000,['MetaData']={['title']='Week seventeen - Will the Tong talk?',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nRiver, our guest has settled in nicely in the cell, not that she had a choice. Our questioning up till now has had some succsess, although enough time has been spent on this Tong agent... it\\'s time to get exactly what we want from her.\\n\\nWhile a small team set off to search another dead-drop location in Deshaan, the rest of of remained, to concuct our plan of interogation. Many, many ways we could extract the information we need came from one another. However it came to light that sister Nattani \"made our prisoner a dress and has made fancy food for her\"?, something isn\\'t right... and needs to be investigated.\\n\\nAnyway, do we cause pain? at the risk of hearing anything to prevent it. Do we take the nice approach? at risk of being taken advantage of? Do we let her out of the cage to walk aro.... NO! A dreadful idea.\\n\\nThe team soon after returned from the dead-drop in Deshaan, along with the listener! Who had been on a serveral week travel to scout out Vardenfell, coming back to us with much to discuss. For now we had Tong interrogation to procced with. For now, the friendly approach, but our kindness will have a limmit.\\n\\nOur Questioning commenced, slower than a horker out of water... talking about flowers? the busy cities? work?...By Sithis what was this? a day at the local tavern with friends? Although slow, steady progresion came. River slowly started to open up. Aparently a fair few Tong faces pass through Narsiss. And apparently her home acted as a safe house? One thing is for cirtain, our prisoner river tried to protect \"Rilndur Aretonyl\" our first suspect, by saying he meant nothing to her. They were seen together, and are more than just friends. Questions about her benifactor were less sucsesful, but ',},['Pitch']=0,['SizeY']=30,['Z']=26937,['Roll']=0,['Alpha']=1,['Color']=889799,['SizeZ']=30,['Id']=1210,['X']=22100,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.249729,['Y']=20464,},[36]={['EffectType']=8502,['Contrast']=3,['MetaData']={['title']='Week seventeen (Part B)',['message']='it seems River was the one who wrote the letters found in the vally ghost snake.\\n\\nwe have two objectives remaining, find out the connections the Tong has to Hulaalu, and what the Tong intend for the brotherhood. Our interogation continues...',},['Pitch']=0,['SizeY']=30,['Z']=26912,['Roll']=0,['Alpha']=1,['Color']=889997,['SizeZ']=30,['Id']=1211,['X']=22082,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.249729,['Y']=20465,},[37]={['EffectType']=8502,['Contrast']=2.700000,['MetaData']={['title']='Week eighteen - A question of integrity.',['message']='A document of events of the brother hood. Written by: Unknown\\n\\nTonight before re-greeting our prisoner, the speakers and listener appear to doubt our integraty and ability, likely due to the complaints of mystery food appearing with lingering thoughts of sister Dee\\'s doing, that we shall not mention. As well as giving too much away at the interrogations.\\n\\nLeading us into the library to a table of... apples...\\n\\n\"One of them is poisoned, all of you, eat up\" We were told, till no apple was left. And so were our orders carried out till no apple remained. Who was going to be joining Sithis in the void? Or better question as it would turn out, who were the \"people\" who would be joining the void. It took little time to see who, Matron Skiri, the Keeper, and sister Gwyn. All fell in intense burning pain!\\n\\nSomething was off... they did not fall to Sithis? Did the farther not want them? No, a trick by the speakers. To test us. So we dont complain about food anymore, to keep our resolve. If only we were so lucky to meet Sithis this day. \\n\\nWith that out of the way a celebration should be in order for the long awaited return of Sister llena Uvelas, who had been gone for far too long even before the plague. May her return bring fortunte!\\n\\nNow, it is time to talk with our prisoner.\\nRiver was very, very stubburn this time around, refused to give any thing away, but in time she will be more forth coming. As she no longer seems to care for herself, I will seek for leverage.\\n\\nSome odd news has surfaced, several memebrs have had encounters with a mage dressed in blue and gold. Here, there, and everywhere... ever cryptic, seems to know something about missing voralmo... what could it mean?',},['Pitch']=0,['SizeY']=30,['Z']=26870,['Roll']=0,['Alpha']=1,['Color']=202399,['SizeZ']=30,['Id']=1216,['X']=22049,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.228785,['Y']=20465,},[38]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='Week nineteen - short negotiations, clensing mayhem',['message']='A document of events by the brotherhood. Written by: Unknown\\n\\nA mid-week interrogation reached an inevitible breakthrough, at the end where nothing but dispair remained for river, however she only offered a deal, in exchange for everything we want to know, she gets to... enjoy some personal pleasures, with those of her choice, in the sunset. Matron Skiri, hastily to agreed to the terms then and there. Perhaps too hasty, not giving proper thought to the situation.\\n\\nA day or two passed, the time came for our gathering, however our atteniton, now placed on other matters than just our guest. For the Listener has recieved wispers from our mother, the oathbound clan, is due to experiance as much mayhem, chaos and leave no survivers! We took a portal the Ravenspire, and dived the depths of obsidian scar, and did the work of Sithis to the word. Soon returning home to hear the word of our Night Mother once more.\\n\\nPausing at the shrine of rememberance of our fallen due to the pluage, to enlighton the new blades of the importance of our past.\\n\\nToday we conduct a ritual, to honner our dread Farther, offering the bones and flesh of the living, to empower us and his servant, and to give form. The ashes of the fallen, and those yet to fall who surve in the unholy name and command. To give the servant purpose. To guard the fallen. We pray to the Dread Farther and his bride, to guide us in enacting the most unholy plans. Let the darkness consume the living, and let there be void in his name.\\n\\nThe farther heard us, and sent on of his servents to empower the shrine of the fallen, with an unholy red glow from within the statue, to protect the fallen.\\n\\nFewer encounters with this crazy mage have been mentioned this week, however he is still out there... where will he appear next?',},['Pitch']=0,['SizeY']=30,['Z']=26833,['Roll']=0,['Alpha']=1,['Color']=66697,['SizeZ']=30,['Id']=1220,['X']=22020,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.193879,['Y']=20465,},[39]={['EffectType']=8502,['Contrast']=3.300000,['MetaData']={['title']='Week five - (Part B)',['message']='Defying better judgement, everyone jumped into the portal leading to the evergloam, against better judgement I may have also done this myself too see what could be explored... after some research and examinations perhaps...\\n\\nWhen in the realm of Nocternal, the most likely find that could have been expected, was still no less of a suprise. \"Brother\" Lock, found within, turning out to be a fully fledged agent of Nocternal, for many months so was told to us.\\n\\nDespite Lock\\'s attempts to explain himself, It is still a clear breach of the tennents that we follow. After aprrehending him, Speaker Velyna did what needed to be done.\\n\\nEnding his life, in the realm that he hid his alleagence too. Is it possible that this was a wasted oppertunity? If he remained alive, we could have possibly manipulated the situation to our long term advantage? either way it matters not now.',},['Pitch']=0,['SizeY']=30,['Z']=27054,['Roll']=0,['Alpha']=1,['Color']=164699,['SizeZ']=30,['Id']=1225,['X']=22211,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.209587,['Y']=20524,},[40]={['EffectType']=8502,['Contrast']=1.820000,['MetaData']={['title']='Week twenty - The varden front',['message']='Matron Skiri and River re-encountered a little bit of time before our gathering. As expected, the black hand did not approve of the hastily made \"deal\" the Matron had made. It was not going to materialise. We may never know if River planned to betray us or to hold up the deal and tell us what we want, but now it matters not.\\n\\nAt this news, River fell to dispair. Turning un-cooperable once again. Believing she will die reguardless of what she does, refusing to give up any unsful answers to any questions. I think the time for leverage is in order, or find another way to convince her to talk. Perhaps extending her stay indefinatly with vampirisum will give us pleanty of time?\\n\\nFor now we settle for a simple illusion spell. A continuous maddening noise next to the prison cell that will play for as long as the fire burns. The flames shall never perish.\\n\\nOur convergance came the next day, however River will have to wait and go mad, for our attention turns to Vardenfell.\\n\\nSome time ago Speaker Vylena started to over see the project of the construction of a sanctuary within Vardenfell.\\nNot long after the... the... \"experiment\" that sister Dee conducted that we shall not speak of, I found my self acompanying speaker Velyna, and a sister to investigate the forward sanctuary construction deap in Vardenfell after not receaving any letters for some time. Uppon arrival, it was soon apparent the workers had gone, leaving an obscure note, and an unfinished job. Although, the walls of the enterence had been pushed open, and a hellish moaning could be heard from inside...\\n\\nFor today we will return in greater numbers to investigate. Although it seems the speakers organised a twist, we were to travel to Varden via mad-man by the name Kenneth Solomon so we are told.',},['Pitch']=0,['SizeY']=30,['Z']=26793,['Roll']=0,['Alpha']=1,['Color']=199920,['SizeZ']=30,['Id']=1227,['X']=21989,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.186898,['Y']=20466,},[41]={['EffectType']=8502,['Contrast']=1.660000,['MetaData']={['title']='Week twenty (Part B)',['message']='Curtisy of the wayrest mages guild who took more than a fair price for our need of services, and acompanying us within as a guide.\\n\\nVenturing in via madman portal, we refind the notes left behind by the workers once more. As well as the portals dotted about. Investigating the first of them, leading to an open upper platform, feturing a floating... talking rock? This mage is crazy... I cant hear anything! And why on nirn has sister Ophelia taken it in as a pet? What we going to do? teach it to sit?\\n\\nThe other portal held nothing. Finally venturing within what will soon become our Varden sanctuary, finding sleeping rolls by the main enterence along with a note reading \"something came in and corrupted the contracted builders\". Further in, the main sanctum held a statue of the mad god himself, and a ball of yarn? prooving too much for Aeriel due to the past, leaving for the time being.\\n\\nAfter entering, seeing that the contractors had nearly finished their work, the mad mage Solomon revealed we were magically trapped and unable to leave, and failing to tell us not to light the braizers, and acting as if he said already? After touching the ball of yarn, Solomon lost all control, begining to chant a sommoning ritual, followed by spontainious death. Glad to see the back of that crazy mage.\\n\\nFollowing the sudden death, the \"talking rock\" of all things wished us to enter the circle by the statue, for protection? It seemed to tell the truth. A golden saint barged in, looking to kill us, but did not enter the circle. Guided by the talking stone, and possibly enraged by the sight of it, Sister Aeriel lit the braziers in spesific secuential order, seeming to defeat the golden saint, breaking the surrounding spell and weakening it. \\n',},['Pitch']=0,['SizeY']=30,['Z']=26768,['Roll']=0,['Alpha']=1,['Color']=209936,['SizeZ']=30,['Id']=1228,['X']=21970,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.218313,['Y']=20466,},[42]={['EffectType']=8502,['Contrast']=1.420000,['MetaData']={['title']='Week twenty (Part C)',['message']='Enough time had been spent already with this golden saint, as an enraged Aeriel walked up to the defeated deadra, rendering it\\'s throte usless. Sending it back to the shivering isles for the next few hundered years.\\n\\nShortly after, Solomon\\'s ghost decided to appear, blaming us for failing the ritual that he attempted? sithis sake mages these days. Promising to haunt the sanctuaires... what joy...\\n\\nAppon returning home now that the containment spell had broken, Ophelia gifted the \"talking rock\" to speaker Velyana. Mad mages and talking rocks, what next?',},['Pitch']=0,['SizeY']=30,['Z']=26742,['Roll']=0,['Alpha']=1,['Color']=189933,['SizeZ']=30,['Id']=1229,['X']=21952,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.186898,['Y']=20466,},[43]={['EffectType']=8502,['Contrast']=2.660000,['MetaData']={['title']='Week twenty one - Lets not keep out guest waiting',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nA moment of delight, much has happened since we got to catch up with our guest River, but now we have the pleasure of planning a catch up with her, and seeing what she has to say.\\n\\nStill, first things first, we need to plan our next move. As we gathered the floating rock hung by the stand. A little creepy if you ask me. Fortunatly we held our meeting away in the other room. \\n\\nMany ideas were tossed around. Leverage, dream walking, illusion, perhaps simply trusting her to tell us wha... NO! Why does sister Natanii keep coming up with that? torture? NO! Looking at speaker Orbeas he might kill the next person who suggests that. To leave some dead-drops in river\\'s place, simply killing her, all many good sugestions. Although it was revealed that the noise spell previously placed by Matron Skiri a few days prior has been removed. I wonder if it could have worked...\\n\\nWe came to a curious idea, to dream walk and remove selective memories and replace them with others, turning her into a spy of our own. Many opinions flew of this, Sister M\\'raaz heavily objected EVERYTHING apart from killing her here and now, although speaker Alice is rather set on the dream walking idea. If Succsesful it would be invaluable, However a large risk.\\n\\nDuring the meeting, it came to light that a small part of brother Jean\\'s memories have returned, in reference that River\\'s memories could also return if altered. \\n\\nWe decide to retire from the meeting to give the the speakers time to think on what we discussed.\\n',},['Pitch']=0,['SizeY']=30,['Z']=27310,['Roll']=0,['Alpha']=1,['Color']=919928,['SizeZ']=30,['Id']=1236,['X']=22372,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.214823,['Y']=20400,},[44]={['EffectType']=8502,['Contrast']=2.500000,['MetaData']={['title']='Week twenty one - (Part B)',['message']='Afterwoulds it was revealed that brother Jonah seems to have an interest in the kahjit? After a misunderstanding with sister M\\'raaz, Dathear wont be bring his interest up again around her. Seems to best way to get sister M\\'raaz to calm is to give her excessive drinks till she falls asleep? That cat can\\'t hold a drink.\\n\\n\\n\\nI digress, For now we plan, and next we take action on what the speakers decide...',},['Pitch']=0,['SizeY']=30,['Z']=27280,['Roll']=0,['Alpha']=1,['Color']=739922,['SizeZ']=30,['Id']=1237,['X']=22351,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.214823,['Y']=20400,},[45]={['EffectType']=8502,['Contrast']=2.600000,['MetaData']={['title']='Week twenty two - Haunting in the workforce',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nSpeaker Alice commanded our attention while we sat and spoke to one another in the main hall. For a new task had come our way and a unique one at that. Through what contacts the Speakers may posess, they uncovered word of an \"Alfred Moorcroft\" who recently bought a very large and run down estate within Glenumbra. Who also hired a work force to clean and clear the place up, thus, an opertunity to get in.\\n\\nAs commanded we split into two teams. Team one, the workers, was to infiltrate, and impersonate the new incomming workers and to reinforce the situation. That, was caused by team two. The spectors. Their job was to remain undetected via invisibility potion, to listen, as well as causing as much chaos, \"haunted\" and supernatural behaviour as possible!\\n\\nSpeaker Alice thankfuly provided the means of travel this time via portal to the outside of the mannor, and the workers strolled in followed by the spectors sneaking behind. \\n\\nUnexplainable fires that light themselfs? Rocks thrown from nowhere. The banging on the door, wispers in the corridors, bodies littered inside the manner? That was unexpected. The scratching getting closer, and the screams of death apon them. To our un-knowing it seemed the place was already the center of a dark motivated past, setting the scene for our preformace. Never the less, oh how little these contracted workers knew.\\n\\nSmelling the state of some of the contracted work force, and how they fled in terror, I have large doubts they will return to the mannor.\\n\\nReturning to the sanctuary after the last of the worker had fled, congratulated by speaker Alice, mentioning that the mannor would make a good safe house for us within the Dagerfall region. Perhaps... a new sanctuary?',},['Pitch']=0,['SizeY']=30,['Z']=27239,['Roll']=0,['Alpha']=0.590000,['Color']=74599,['SizeZ']=30,['Id']=1249,['X']=22320,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20399,},[46]={['EffectType']=8502,['Contrast']=2.120000,['MetaData']={['title']='Week twenty three - A quiet night... perhaps, too quiet?',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\n\\n\\nRumors have spread not just throughout Glenumbra, and the entirity of Daggerfall. Of a haunted house that those should not dare approach, and the tales of the fate of the work force, along with how local peasants have seen ghostly apparitions near the mannor spread within the tavens of the region. \\n\\n\\n\\nShifting stone on stone lightly echos as one steps in, skeletons remain alert, ever still and silent. The occasional water droplet tapping just within the cavern. \\n\\nBaron-less of footsteps through the gates. Nor down the slopes. Only echos of roaring rain resonate from within. \\n\\nPatience, ever lasting, as a wraith\\'s eyes survey around for its next training practitioner, amongst the crackling fire. Not far astray from a sleeping pest... guest... perhaps one should say.\\n\\nEver present, and yet ever there a void, the one we serve up the overlook near where those will pray. Up and past his guardian to those who now forever sleep, no purposeful silence within the vast land of books, nor there be those words nor cheers echoing from beyond the empty halls.\\n\\nPerhaps there are those who rest further within? Best to leave them be.\\n\\nPicking up his drink and looking around. \"aye it be quiet in \\'ere t\\'nite\"\\n\\n\\n\\nSilence reigned this night. Golden Silence of the void.',},['Pitch']=0,['SizeY']=30,['Z']=27195.098312,['Roll']=0,['Alpha']=1,['Color']=959997,['SizeZ']=30,['Id']=1252,['X']=22290.183920,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20400,},[47]={['EffectType']=8502,['Contrast']=2,['MetaData']={['title']='Week twentyfore - A question of rank and rain',['message']='A document of the brotherhood. Witten by Unknown.\\n\\nInterestingly, for today we hold our meeting within Speaker Orbeas sactuary within Aurdorian. A good call considering we should use the other sanctuaries more often. Heading there via portal from Kavatch.\\n\\nAfter a small tour around the grounds for those who had not visited before, we gathered before the speakers in the main hall who had an announcement.\\n\\nFor on this day, Matron Skiri became Speaker, and Sister Neirim became Matron of our Kavatch sanctuary.\\n\\nTo them, Congratualations, may they do well in their new roles!\\n\\nAlthough there are unconfirmed whispers of... Matron Max?\\n\\nWhile in the Dominion sanctuary, somehow we had a guest appear at our doors, seeming to know who we were, wishing to make a deal for something... someone, she wanted back.\\n\\n\"Rain Avanii\", She named herself. Placing her weapons to the ground, and offering information in exchange for her sister, suggesting she had information we will find useful. As well as several contracts, that we may want to aquire.\\n\\nUnsure what to make of this, we took a letter from her, and advised her so stay in town. Under the hidden eyes of Speaker Orbeas agents.\\n\\nOn other ventures, Speaker Skiri, ventured into Artaeum seeking infomration on missing brother Voralmo. Learning he had not been seen in several months, since borrowing a few books. Including that he may have a home in Alinor, as where most high Elves live.\\nAnd fewer sightings of this mad psijic monk have been seen. \\n\\nI also believe before Speaker Skiri can truly take on the role, she needs to get her relationship affairs with Sister Fox and Matron Neirim. I\\'m sure this is a second time now. It\\'s time to make up your mind speaker Skiri and stop looking at their...\\n\\nWhat is yet to come? is yet to be seen',},['Pitch']=0,['SizeY']=30,['Z']=27155.283026,['Roll']=0,['Alpha']=1,['Color']=698,['SizeZ']=30,['Id']=1257,['X']=22258.860655,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20401,},[48]={['EffectType']=8502,['Contrast']=3,['MetaData']={['title']='Week twentyfive - Lost family relics, and haunting rewards',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nWith the remaining workers after the incidents of the Kushalit Sanctuary within Vardenfell, Speaker Velyna continued to unpack numerous oddities each stranger than the last. A sheild to ward the strongest of magic but momentarily vanishes at the first physical touch. A flute that summons a drum, which both summon a singing dremora, amoung other strange artifacts. Coming to a journal suposidly written by a wandering mage who had written about demensonal travel within, places with warriors with swords of light to worlds of metal and war raging giants. Or perhaps a land of nightmares where its creatures who\\'s blood dissolves what it touches. Slowly closing the book, Maybe it would be best such a book was burned?\\n\\nWith the previous discovery at the Dominion Sanctuary of River having a sister who desperately wants her back and appears to be willing to do anything for it, we find our selfs in a uniquely privilaged position, finding out that the letter \"Rain\" gave us, was the name of a Tong benifactor. As \"a sign of good faith\".\\n\\nMuch was discused on how to exploit this situation. Allow them both to escape while we follow? Or perhaps take them both as slaves? Tortue one to get information from the oth... NO! Thank Sithis Speaker Orbeas was not present to hear Silver scale suggest torture. Maybe take them both prisoner? As the speakers said, for now as long as one continutes to worry about the other, rain will continue to work with us willingly. We will continue to keep watch of her within Vulkul guard.\\n\\nAlso, whats with all the smoke Sakos Silver-Scale keeps exhaling? Is he secretly a mini volcanio?\\n\\nAnyways...\\n\\nHowever for now we have other mattered to attend.\\n',},['Pitch']=0,['SizeY']=30,['Z']=27114,['Roll']=0,['Alpha']=1,['Color']=38199,['SizeZ']=30,['Id']=1268,['X']=22231,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20402,},[49]={['EffectType']=8502,['Contrast']=3.080000,['MetaData']={['title']='Week twentyfive - (Part 2)',['message']='Speaker Alice opened a portal, returning us all to the daggerfall mansion that we haunted a few moons prior. In a twist of events, this run down place was once Speaker Alice\\'s family home. Lost when her blood fmaily was betrayed and killed. Their estates taken and or sold over the years. \\n\\nAllowing ourselfs in through the barricaded door due to the previous workers sealing it and escaping from the basement, via Silver-scale burning it down with volcanic like breath.\\n\\nThe place inside had been truly trashed by its various occupiors over the years, Although we recover it today, and soon the deed its self from \"Morecroft\", in the name of speaker Alice and a new Covernent sanctuary, and to the furture slow sabatarging of Morecroft.\\n\\n',},['Pitch']=0,['SizeY']=30,['Z']=27087,['Roll']=0,['Alpha']=1,['Color']=158999,['SizeZ']=30,['Id']=1269,['X']=22212,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20402,},[50]={['EffectType']=8502,['Contrast']=1.700000,['MetaData']={['title']='Week twentysix - Defient deeds of ownership',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nBegining with idle chatter within the main hall. Sribbling in note books, enjoying food and wine. The keeper\\'s chants to new castles and dark divines. Which somehow lead to a roumour that the Listener is a dragon preast? How would that be possible?\\n\\nAswell as Speaker Skiri seeming overly pleased with herself, much like a cat who caught a canairy but wouldn\\'t say why.\\n\\nAppearing from a burst of light Speaker Alice walks into the main hall before us, speaking of an expected letter of which has recently arived. That \"Sir Moorcroft\" was able to aquire a new work force now that the rumours had died down within daggerfall, and was returning to the manner today.\\n\\nIt was time to claim our stake, proposing to uproot Moo-croft, by replacing his workforce ourselfs. Then when inside, get him to officially sign over the deed to speaker Alice.\\n\\nWe were given fore names, and 4 assigned to replace them. Arghragdush an orc over seer, Erisa a lowly worker at the mill. And Danfforth and Catherinel the handlers of the requested shipments.\\n\\nwhile most head off to replace those named. Speaker Alice and a few traveled directly to the Estate to awaite for the rest when they succeeded.\\n\\nHeading in, confronting Sir Moo-croft, a rather comedic encounter ensues, blending into what he believed to be his work force, yet remaining adament he did no wrong, while insulting his former workers.\\n\\nHowever, soon afer, posing as Ms Lachance, and the Occupational safty and health organisation of wayrest. Ordering him to sign a contract for \"court procedings\", making the estate \"collateral\". First resisting believing the speaker to be an imposter,',},['Pitch']=0,['SizeY']=30,['Z']=27050,['Roll']=0,['Alpha']=1,['Color']=109913,['SizeZ']=30,['Id']=1272,['X']=22183,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20401,},[51]={['EffectType']=8502,['Contrast']=2.240000,['MetaData']={['title']='Week twentysix - (Part 2)',['message']='but eventually coming around on reading the papers, offering to \"pay up\" for the loss of life, however refusing to sign over the land claiming it his own.\\n\\nEnough was enough, so as \"helpful\" persuasion, the speaker ordered Jonah to rip off his arm. Not having a blade, Jonah takes out a mace and smashes Moo-crofts hand instead. Yet despite being offered a way out, Moo-croft remained confidently defient and resulted in him paying with his head.\\n\\nAs we believe Moo-croft has no other family, the estate should return to its origonal owners... The one and only, Speaker Alice Lanchance.\\n\\nWhile home, M\\'raaz seems to take much of a liking to Ophelia, despite the confusion of an illusion or two minds and one body. And Speaker alice, Silver Scale, and Jarvis, continue to sort out the paperwork and make plans for future estates and that of the manner.\\n',},['Pitch']=0,['SizeY']=30,['Z']=27024,['Roll']=0,['Alpha']=1,['Color']=9906,['SizeZ']=30,['Id']=1273,['X']=22164,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20401,},[52]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='week twentyseven / real life week 36 - A family home restored',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nWords whisper within. Joyful news of the completion of the Vvardenfel sanctuary travels to one another. However none could be more over joyed than its owner. Speaker Velyna herself. At least, she was, intill the slightly crooked painting caught her eye, which soon met a destructive end.\\n\\nOur gathering concerntrated in the main hall. Gitzo Complementing how \"tasty\"? We looked when arriving, as those already present spoke of how brother Ja\\'zakar came to join us. \\n\\nThe floating rock hovered above disapproving of the story of war being told before it. Back in the days when Speaker Skiri and brother Jazakar, or Saran as he was known back then, fought in the three banner war.\\n\\nThe rock finally spoke to all, seeming to claim its self above all mortals with the ability to crush us. Yet it wont? Because it \"just... a rock\" ha!.\\nAnyway, having walked into a dominion ambush, Skiri left for believed dead and Jazakar taken captive by the dominion forces lead by a \"Damaz Ran\"...\\n\\nOn this occasion the rest would have to wait, Speaker Alice interupted, leading us to the portal hall. Smurking and walking into a portal. In a twist of events, the portal said no and refused to let Speaker Alice through at first.\\n\\nAfter a few tweeks, we went through the portal, giving Speaker Skiri a head ache? And returning to the manner we aquired the deed for a few weeks prior, Speaker Alices home.\\nIt was clear how much work had been done over the past few weeks seeing the outside alone. Towering magnificently above, in perfect in plain sight. Its public front yet to evolve as a manner and vinyard...',},['Pitch']=0,['SizeY']=30,['Z']=26983,['Roll']=0,['Alpha']=1,['Color']=649921,['SizeZ']=30,['Id']=1291,['X']=22136,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20402,},[53]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='week twentyseven / real life week 36 - (Part B)',['message']='Heading inside, Speaker Alice presented an outstanding decor, equiped with everything we could need, however requesting we ware more public attire when within the grounds, as precaution. Upstairs, a hidden bedroom behind the magnificent fireplace for us, below in a now hidden basement, the sanctuary itself.\\n\\nDuring our celebration of the new sanctuary, a fake max appeared. You would sware it was him though. He just stood there... menacingly!',},['Pitch']=0,['SizeY']=30,['Z']=26955,['Roll']=0,['Alpha']=1,['Color']=649921,['SizeZ']=30,['Id']=1292,['X']=22116,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20402,},[54]={['EffectType']=8502,['Contrast']=3.030000,['MetaData']={['title']='Week 37 - Sending a message',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nOur gathering began with quiet chatter, most of the brothers and sisters were out on jobs at the time. Although that doesn\\'t mean the rest of us didn\\'t have some fun.\\nAccording to Speaker Orbeas\\' spies, the Morag Tong have increased their activity at the Merkmire boarder from Shadowfen, but are unsure of their intentions.\\n\\nThus, our lastest task. We cannot allow the Tong to gain a foot hold as they once did in Deshaan and the speakers believe the best way to do that is to send a polite reminder to keep out of our way...\\n\\nSo to keep them in line we will hit where their activity has been noted within the Harbour of Alten Corimont in shadowfen. All present there will be sent to farther Sithis.\\n\\nAs an extra bonus, and Dunnmer that fall this day get special treatment to help the messenger along, by cutting all their hands off... and possibly some dissmemberment.\\n\\nSpeaker Skiri ordered that if any were to start running when we begin the massicure, that they are hers to kill. With those in mind, we excecuted our mission, some contributed more than others but all within the harbour fell with beautiful teamwork efficiency!\\nI think Speaker Skiri may have over estimated the amount that would get the chance to run. I doubt any sliped through our grasp.\\n\\nThe Tong must foolishly think we too occupied keeping them out of Deshaan to confront them within Shadowfen? Let\\'s hope they get our reminder message.\\n\\nRegrouping, it transpired that Speaker Skiri had made a new friend in the form of a scuttler that she happily petting as it was sitting on her lap atop a tree branch.\\n\\nAll could say the job almost went prefectly. Almost...\\nDuring our parade sister Meriath survearly wounded and needed tending too.',},['Pitch']=0,['SizeY']=30,['Z']=26915,['Roll']=0,['Alpha']=1,['Color']=154499,['SizeZ']=30,['Id']=1293,['X']=22081,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.244493,['Y']=20405,},[55]={['EffectType']=8502,['Contrast']=3,['MetaData']={['title']='Week 37 - (Part B)',['message']='Fortunatly our job was done and with a spell scroll: Skiri opened a portal home, quickly followed by her little scuttler friend jumping through after her.\\n\\nScooping Meriath up, speaker Orbeas had no trouble carrying her to the dorms, nor had any trouble tending to her wounds with careful, well practiced hands. What other skills could speaker Orbeas hide?\\n\\nDue to the severity of her wounds, Meriath ideally still needed a healer, although with none present Orbeas\\' medical abilities and bandages will do for now.\\n\\nAnother discovery from within presented itself when brother Alexius, the incarnite of silence, held out two apparently home made healing potions to jean who was now watching over Meriath, to give to her. Who would have guessed Alexius was an alchemist?\\n\\nAs the evening came to a close, sister lliafirewen joined us, who was asked about her specialities in magic. Although it was quite the laugh when skiri was admiring her mount: \"It\\'s quite unique, how do you keep it alive?\"\\n\\n \"It\\'s dead\" \\n\\nLliafirewen bluntly stated.\\n',},['Pitch']=0,['SizeY']=30,['Z']=26891,['Roll']=0,['Alpha']=1,['Color']=154499,['SizeZ']=30,['Id']=1294,['X']=22062,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.244493,['Y']=20405,},[56]={['EffectType']=8502,['Contrast']=2.820000,['MetaData']={['title']='Week 38 - The negotiations table',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nBeginning with a strange round of murder mystery. Who left a dead telvanni on M\\'raaz\\'s floor? The present was apparently appreciated but the blood stain in on the carpet was nothing to smile over.\\nWas it Natanii? Who claimed to have played with the telvanni when alive? Or could it have been M\\'raaz in a drunken venture? Perhaps another entirely?\\nCatching the literal tail end of the Kajiti tale, most may never know.\\nEnough idle chatter for now, it was time for business.\\n\\nHeading to Speaker Orbeas\\' sanctuary within Audorian, it was time to catch up with Rain Avanii who Calixte had been keeping an eye on all this time. However before we seek out our acquaintance, we formulate our plan.\\n\\nAs all Rain wanted was for the safe return to her, we control the terms. Speaker Orbeas and Dathear seemed to almost share an idea, as a near perfect twin to River, her sister Rain could easily slip into her shoes. To work for us within the Tong as our informant in Rivers place. We would also secretly send in sister Meriath along side her, to ensure Rain stays in line.\\n\\nA risky plan for sure, with much that could go wrong. With just as much to gain too, nothing is achieved without risk after all.\\n\\nOrdered to find a better suit of clothes to blend in better in Mathiisen we head inside to change and then await out side for everyone when ready. Waiting for the new blade to change gave us time to see our chosen attires, easily seeing Speaker Orbeas was presented best. This was his home after all.\\n\\nHeading out and meeting Rain in the town. All were surprisingly calm, but there was a nervous hint in Rain\\'s voice.',},['Pitch']=0,['SizeY']=30,['Z']=26850,['Roll']=0,['Alpha']=1,['Color']=919494,['SizeZ']=30,['Id']=1295,['X']=22032,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.216568,['Y']=20405,},[57]={['EffectType']=8502,['Contrast']=2.670000,['MetaData']={['title']='Week 38 - (Part B)',['message']='Beginning the negotiations as Orbeas set the terms, for the safe return of River and for now proof that she was alive, we wanted the most recent and reliable information on the Morag Tong as well as for Rain to slip into River\\'s shoes being perfect twins and pose as a member of the Tong as our informant. We would also provide enough information and training to prepare Rain for this task.\\n\\nIt was clear some thought took place stating as long as we kept our end of the deal, but agreed none the less to the terms. \\n\\nTo ensure we could keep an eye and provide the necessary preparations, Rain was to remain in town and was lead back to the manner to stay intill she is ready for her task. Heading back in good time too, the keeper was becoming increasingly annoyed with the local farmers to the point where who could have told what would happen if we remained in town.\\n\\n\\nIn the manner courtyard we stood all stood. First to prove to Rain that her sister River was still alive. Having a portal to the main sanctuary opened, Orbeas stepped through. A few minutes go by before he re-appears in view of the portal holding River beside him in full view of Rain on our side of the portal at the manner.\\n\\nThe twin sisters both paired equal shock and joy to see one another once more, the most life River has displayed in many weeks too. I think our point has gotten across to the pair.\\n\\nDisappearing from view once more for a few minutes, assumably to put River back in her cell, and then re-appearing once more, Orbeas stepped back through the portal to the manner as the portal closed behind him. ',},['Pitch']=0,['SizeY']=30,['Z']=26825,['Roll']=0,['Alpha']=1,['Color']=919494,['SizeZ']=30,['Id']=1296,['X']=22012,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.216568,['Y']=20405,},[58]={['EffectType']=8502,['Contrast']=2.620000,['MetaData']={['title']='Week 38 - (Part C)',['message']='Thanking us for not harming her, thus agreeing to the deal once again. I can\\'t even begin to imagen how smug Orbeas must be about not torturing her.\\n\\nTo assist in her training, Rain is being provided with books, a climbing wall, practice dummies, and other tools that will be of assistance. That we also took advantage of ourselves. Unfortunately the keeper chose the wrong wall to climb and fell breaking his pelvice, or... at least he was in agony.\\n\\nPulling the Keeper up over his shoulder, Orbeas had no problems carrying the rather defiant Keeper to the manner dorms. Who remained adamant that he will be trying to get back up to mother, refusing to see a healer.\\n\\nSpeaker Orbeas was having none of it, holding the keeper down and summoned a healer that was present among us. The keeper was not amused.\\n',},['Pitch']=0,['SizeY']=30,['Z']=26797,['Roll']=0,['Alpha']=1,['Color']=919494,['SizeZ']=30,['Id']=1297,['X']=21992,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.216568,['Y']=20405,},[59]={['EffectType']=8502,['Contrast']=2.880000,['MetaData']={['title']='Week 39 - The lost and the found',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nIt would have been usual meeting and greetings between us all, if not starting with much concern. During mid-conversation Speaker Alice fainted, falling to the floor stone cold. Even for a vampire.\\n\\nFortunately it soon became clear that exhaustion was the cause, as Alice asked us \"to leave a message\" in a drowsy tone. Some blood from Varni\\'s on hand vials was an excellent help, helping immediately.\\nAmong the brief concern, Matron Neirim was welcomed back from her past few week travels, and that the listener had finished his place and resumed his experiments once more.\\n\\nGathering our attention, Speaker Skiri read aloud from a letter. The sacrament has been preformed, however it requested that we travel to Deshaan where we caught River. It goes without saying the thought of a possible trap loomed above us all.\\n\\nWe are to meet a Telvanni wizard by the name of Tavron. To keep our wits sharp about the mage, and to make sure we had a decent disguises, while traveling around Deshaan. \\nIf we smell anything fishy, be that Tong or other fishy foes, Speaker Skiri trusts we know what to do.\\nDropping out from the task, Natanni decided not to join due to having enough of the telvanni in the past.\\n\\nWe left by portal, Alice dropped us off just on the edge of Narssis and head to the wizard\\'s home entering one by one. Within was a dark and dusty main hall and a dunnmer wizard, each of us greeted upon entering, as the mage ordered his servant to provide us with drinks. I think we\\'ll pass.\\n\\nWhile eyeing Matron Neirim and Speaker Alice it seemed... But getting to the point Tavron wished a woman named Flowers-In-Shadows dead. Boasting that apparently he would do it himself if he had the time.\\n',},['Pitch']=0,['SizeY']=30,['Z']=27314,['Roll']=0,['Alpha']=1,['Color']=112299,['SizeZ']=30,['Id']=1300,['X']=22359,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20339,},[60]={['EffectType']=8502,['Contrast']=2.860000,['MetaData']={['title']='Week 39 - (Part B)',['message']='Tavron went on to explain that this woman was kept by her master somewhere near Mournhold, and then stopped. Gee, what a lot to go on. As we began to leave he made two last requests. Firstly that we deliver the target\\'s pendant to him as proof.\\n\\nSecondly, asking if either Alice or Neirim would like to stay behind with him... to entertain him. Some of the looks that our brothers and sisters gave him, Tavron was lucky we didn\\'t make him a contract right then and there.\\n\\nRiding and then arriving at Mournhold, our search began. \\nA Few hours pass by, but sure enough we found the target. Surrounding her we wonder who would like the honours. However an arrow from an impatient brother above hit its mark, as Flowers-In-Shadows fell stone dead.\\n\\nReturning to the Telvani\\'s home, semi-tossing the pendant at Tavron that Alice took from the target not long prior.\\n\\nAs payment was discussed, Listener Vehk was forced to pull Silver-scale aside for his unnecessary urges and intimidation to the client. Ordering him to calm down or get out.\\n\\nWhen all was said and done, Tavron was eager to show us more, asking to lead us down to the basement, pushing his servant into the wall to walk past down the steps. With a click of his fingers the back wall vanished, revealing a cage.\\nInside the cage was the husband of our target. Throwing the pendant at the battered and crippled argonian. Gloating, and proceeding to hit the imprisoned argonian with a lightning spell.\\n\\nAs this brutal display went on even by our standards, the imprisoned Argonian caught the eye of the listener following a spark of realisation. \\nEnough was enough. Giving a nod to M\\'raaz, The Listener gave the order for Tavron\\'s execution. Evading the first few strikes the battle continued above while we released the argonian. ',},['Pitch']=0,['SizeY']=30,['Z']=27289,['Roll']=0,['Alpha']=1,['Color']=112299,['SizeZ']=30,['Id']=1301,['X']=22340,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20339,},[61]={['EffectType']=8502,['Contrast']=2.880000,['MetaData']={['title']='Week 39 - (Part C)',['message']='Known to the Listener as Looks-For-Flowers, or Greg. A fellow brother from, long long ago.\\n\\nThe fighting above did not last long, with a swift swing to the neck, Tavron\\'s head fell and was claimed as a prize.\\n\\nWe attempted to convince Looks-For-Flowers to come home with us, however in his current state of collapse and sorrow, breaking down in tears and screams in the matron\\'s arms, he was not able to make that choice on his own.\\n\\nAlexius lifted Greg up when he became too weak to stand, and carried him home through the portal home and to the dorms to begin bringing him back to health after clear years of torment.\\n\\nA late meeting was called for the Listener had something to say. That over the past few contracts including today, some of us have not been professional when interacting with our clients. And if it continues it will begin to damage our reputation. \\n\\nIt stops today...',},['Pitch']=0,['SizeY']=30,['Z']=27262,['Roll']=0,['Alpha']=1,['Color']=112299,['SizeZ']=30,['Id']=1302,['X']=22322,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20339,},[62]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='Week 40 - The Morag Tong profile',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nThe speakers believe they have new information to share and it seems no stone was left unturned in pursuit of it. Commanding our attention once again to share what they have found.\\n\\nFinding every small detail the speakers could place a hand on, to build a profile on a high ranking member of the Morag Tong. Who we believe has interests in Skyrim.\\n\\nFrom what the Speakers have gathered; we have reason to believe this person is emotionless and ambitious, caring little for what will not help his causes, trusting almost no one. Rapidly climbing the ranks of the Morag Tong as a result.\\nIt was also discovered that, as traditional dunmer, following the culture and main traditions as such would be highly likely. Who also is a stratagist and \"calculating\", enjoying spare time in the form of delving into puzzles. \\n\\nDespite these traits that may pose a few thinking problems for us, there are a few things we can work with much more easily. \\nA suspected risk taker, and the youngest of three brothers in his late twenties to early thirties with the typical arrogance.\\n\\nA few ideas are thrown back and forth on how we could possibly draw him out of hiding, luring out with an artifact? Or perhaps really making them angry? As well as other ideas on how to get them out of Skyrim if they truly have an interest in the area.\\n\\nQuickly becoming clear we need more information, be begin to discuss places and organisations within Skyrim who may know about recent dunmer activity. Landing our attention on the thief\\'s refuge in eastmarch.\\nHopefully those inside will know what we need to know.\\nDeciding not to come due to the cold possibly affecting his volcanic nature, Silver-scale dropped out from the task.',},['Pitch']=0,['SizeY']=30,['Z']=27221,['Roll']=0,['Alpha']=1,['Color']=49098,['SizeZ']=30,['Id']=1303,['X']=22292,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20340,},[63]={['EffectType']=8502,['Contrast']=2.620000,['MetaData']={['title']='Week 40 - (Part B)',['message']='Opening a portal for us, Natanni dropped us off just outside Eastmarch from which we head into the city, and down into the depths where thieves reside.\\n\\nWe poke, pry, and prod with careful questioning. Trying to raise as little suspicion as we can. \\n\\nMost down there either didn\\'t know a thing... not willing to talk. However there were a few we could consider ashened gold.\\n\\nWe learn; That a group of Dunmers have taken interest in the Ice Reach coven and the lost knife hideout, that house Redoran is running a private boat service for dunmer to reach Skyrim from Vardenfell, and a large group that recently came in should still be in town.\\n\\nClearly that there is increased interest and dunmer activity within the Skyrim region. What will it all equate too? Is the million gold coins question.\\n\\nResiding back within the walls of the Kvatch Sanctuary, a chilling darkness began to pull itself in.\\n\\nShadowy figures, echoing crows, harsh winds blowing bellows. Then... nothing. Leaving as quick as it came. Leaving, patches of snow at our feet. What could this be?\\n\\n\\nAmoung further news, Speaker Velyna is nowhere to be known, vanishing with the wind. We all hope for her safe travels to where ever she may go.\\n\\n',},['Pitch']=0,['SizeY']=30,['Z']=27195,['Roll']=0,['Alpha']=1,['Color']=49098,['SizeZ']=30,['Id']=1304,['X']=22273,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20340,},[64]={['EffectType']=8502,['Contrast']=1.540000,['MetaData']={['title']='Week 41 - The will to survive',['message']='A document of events of the Brotherhood. Written by: Unknown\\n\\nAfter many months, sister Ollie returns before us once more, after a suspected death? Greeting each one of us present with a confident smile. Much to the family\\'s surprise, but celebrated her return!\\n\\nNone were more surprised or more happy to see Ollie\\'s return than Speaker Skiri herself. As the pair embraced each other in a short hug and continued signs of affection for each other throughout the entire night.\\n\\nWarned of the long story soon to come as to why Ollie had disappeared for so long, eagerly we all sat around, drinks to hand, ready to hear the tale.\\n\\nWanting to learn more of her own personal past, Ollie began to research her own family. After discovering an old letter from an unknown brother is when the problems started to arise.\\nWithin the re-found letter, explaining that this \"brother\" had sold information regarding Ollie\\'s family boat to pirates, resulting in Ollie\\'s parents losing their lives.\\n\\nLost in rage and fueled by anger after what Ollie had learned, deciding to track her so called \"brother\" down brought her into the regions of Highrock. To deliver a slow death. It was not a difficult task. Believing it to be the end. Or so it seemed.\\n\\nReturning to her hideout in hopes of rest... she was followed. Realizing too late a hoard of undead with Ollie\\'s now undead brother leading the charge to her door. The work of a necromantic cult no doubt.\\n\\nTrapped with no time to spare and ever defiant to let them get her Ollie rushed around her lab creating a bomb to take them all down with her if need be.\\nWhich leads the question, how did she survive? Or didn\\'t ask for help? Due to the matter being personal, she didn\\'t want to bring any problems to the brotherhood.',},['Pitch']=0,['SizeY']=30,['Z']=27158,['Roll']=0,['Alpha']=1,['Color']=139914,['SizeZ']=30,['Id']=1305,['X']=22244,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.190388,['Y']=20341,},[65]={['EffectType']=8502,['Contrast']=1.540000,['MetaData']={['title']='Week 41 - (Part B)',['message']='A logical conclusion to be fair.\\nOllie herself, was unsure how she even survived. Waking up, buried within the burning wreckage all around her. Crawling in agony from the cave, but succumbing to the gases, fainting... falling into the nearby river.\\n\\nIn a miracle of sheer will, Ollie regained consciousness once more finding herself at the shore line. Exhausted, hungry, and bones broken. Forcing herself to feed off anything she could, killing the residence of a farm she came by in order to hide and heal for several weeks.\\n\\nStill unsure if the necromantic cult was tracking her Ollie decided to disappear for much, much longer. Living a hidden life as a nomad until all believed she was dead. Before returning back to us, Her real family. Welcome home, dear sister!\\n\\nHow all this took place and Ollie remained alive? Sithis may only know or willed it.\\nOne thing is for sure however, we have a lot... of catching up to do.\\n\\nAfter the story Ollie and Speaker Skiri took some time to catch up. After so long we all assumed she was dead. Including Skiri, despite it troubling her greatly. Yet now feeling more conflicted than prior, still harboring feelings for dear Ollie, but still desired to keep her promise to Matron Neirim? I thought it was believed Sister Ophelia and the matron were together? Also, where is Ophelia? Speaker Skiri had said Ophelia will return soon. What could that imply?\\nThis mystery is shrouded in fog... One wonders, for how much longer?\\n\\nStrange breezes passes through the halls once again, leaving snowflakes in its many paths. It begins to carry whispers in its streams, \"No peace find. No friend keep. No lover bind. No harvest reap. No repose take. No hunger feed.\" Repeats in the wind, over and over....\\n\\nIt fades away... all is well once more....',},['Pitch']=0,['SizeY']=30,['Z']=27130,['Roll']=0,['Alpha']=1,['Color']=139914,['SizeZ']=30,['Id']=1306,['X']=22224,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.190388,['Y']=20341,},[66]={['EffectType']=8502,['Contrast']=2.820000,['MetaData']={['title']='Week 42 - The cave of curiosities',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nWe gather again, with brother Alexius to thank for supplying the means to our next success. A map, the areas of Lost Knife cave, that we now suspect the Tong have interests in. Thanks to a prior week discovery.\\nOur task was to travel to the mine and relieve the miners of their duties. To kill their captor, a magister known as Osanne, how ever we see fit. Aswell as to maintain stealth, we still don\\'t know the extent of the tong\\'s presence.\\n\\nHobbys opens a portal to Eastmarch. \"Yeeting\" our mounts thr... opening a separate portal to the stables for our mounts to follow through.\\nThe roads from the shrine to the mine were.... quiet... to quiet? Not even the more common traders seem to pass us by.\\nReaching the mine, being reminded that this is not to be a mass murder, a strange revelation. Where were the door guards?\\n\\nHeading further into the depths, barely a footstep or echo could be heard. It was as quiet as the grave...\\nDespite the un-easy silence, small groups of miners were found dotted about within the tunnels. Freeing them and leaving their forceful observers dead. It soon became clear by their attire, these were no simple hired slavers.\\n\\nRealising we need to know more about what is going on here, a slight change of plan was in order. Deciding to first question Magister Osanne. To see what she would reveal.\\n\\nThe new blade Ursulie and brother Hobbys eagerly jumped to their wishes of torturing the magister to extract information, without the slightest hesitation.\\n\\nSpeaker Skiri rolled her eyes at the request, denying them immediately. Thank goodness speaker Orbeas was not here to hear that...\\nFirst thing first, we pull aside a miner, who of which, clearly shaken and afraid.',},['Pitch']=0,['SizeY']=30,['Z']=27091,['Roll']=0,['Alpha']=1,['Color']=869911,['SizeZ']=30,['Id']=1308,['X']=22199,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.178171,['Y']=20341,},[67]={['EffectType']=8502,['Contrast']=2.750000,['MetaData']={['title']='Week 42 - (Part B)',['message']='And due to not being told herself, had no information to share despite Hobbys\\' intimidation.\\nYet pointed us to the magisters location none the less begging to be freed.\\n\\nMoving on, finding ourselves on the platform above a well dressed mage, staff in hand. It had to be our target. Or at least we must now hope.\\n\\nIn an act bordering defiance of the speakers orders, Jonah jumped down assassinating the target before we could extract any information, splitting head from body. Perhaps he misheard the speaker?\\nAs a twist of twisted fate, the now severed head begins to scream in agony, the work of Hobbys\\' spell. We had other matters to look to however other than a disturbing hobby.\\n\\nA note searched off the magister\\'s body noted that the Morag Tong paid the magister to take over the mine, and to send all its produce to House Hlaalu. In an effort to force Eastmarch to become dependant on their trade.\\n\\nHaving freed the captive miners and our suspicions confirmed via this note we look to leave. As we do, some rocks shift and fall above as a shadowy figure hurried out the exit door above.\\n\\nGiving chase to further footsteps and... laughter? The mineshaft walls begin to tremble and support beams set a-blaze with unnatural speed.\\n\\nRealising that reviving a troll wont help, Hobbys opens a portal to the grounds above, hurrying ourselves and the miners through with not a moment to spare.\\n\\nThanking us, the miners acknowledge their debt to us, heading back to their homes. While we, likewise, head back to ours.\\n\\nClearly some... thing?... was ready for us in that mine... but what? Or who?\\n',},['Pitch']=0,['SizeY']=30,['Z']=27064,['Roll']=0,['Alpha']=1,['Color']=869911,['SizeZ']=30,['Id']=1309,['X']=22179,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.178171,['Y']=20341,},[68]={['EffectType']=8502,['Contrast']=2.750000,['MetaData']={['title']='Week 43 - Something is on the prowl',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nSome time before our gathering, another dead crow within our halls filling the air with rot and decay could not be unseen. \\n\\nThe flesh apon it seemingly eaten by the frost itself...The same reports are stacking up within all our homes... \\n\\nScreams and chilling wind. Flickering fires to patches of snow. Shadow\\'s run and dead crows.\\n\\nSomething is planning to make its move...\\n\\nAn un-easy silence took firm grasp over the lands. From the western coasts of Glenumbra where the docks fall still, to the arch-a-pelegos of summerset yet no footstep can be heard.\\n\\nNo cries of war, nor boasts for the throne at the heart of lands at the White gold tower.\\n\\nNo proud Nord cheers in the taverns of the Eastmarch, nor spashes of the swamps of the Murkmire folk. Silence, takes the realm.\\n\\nStrange oddities now lurk in the sanctuary halls. Darkness spreads and dead crow calls...\\n\\nDousing the lights, laying out the string. Catching shadows, is now our calling.\\n\\nLike bait on a line, this fishing will take time. Catching a shadow, our prize in mind.\\n\\n(In short the servers went down during the time of the event, and is posponed till next week. \\n\\nHappy Halloween to all!)\\n',},['Pitch']=0,['SizeY']=30,['Z']=27025,['Roll']=0,['Alpha']=1,['Color']=2399,['SizeZ']=30,['Id']=1310,['X']=22152,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.188643,['Y']=20343,},[69]={['EffectType']=8502,['Contrast']=2.180000,['MetaData']={['title']='Week 44 - Reborn of shadow, ice, and snow',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nA documentation of events of the brotherhood. Written by: Unknown\\n\\nCreeping thoughts loomed over all of us as we gathered, the dimmed lights and spell woven strings caught no intruders, yet the feeling of constantly being wached forever remained. Quickly beginning to discuss the problem amoungst ourselves as to what to do about what was in our halls. As we spoke the very ground began to freeze. A layer of snow on a non-existant breeze. Something was near... Placing crow feathers and cracked bones into our possesion.\\n\\nHarsh winds begin to whistle through our halls bringing added snow in its streams. Cracked bones and tiny skulls also roll at us in its breeze. Followed by a shreaking scream piercing through the winds where we finally had enough and made our move.\\n\\nRushing to the entrance to be met with a pitch black shade that just stood within the main hall. Taking up arms, yet not all were as it seemed. Responding, communicating, in mime? The shade, she happily and energetically mimed answers to our questions. Through a series of nods or shaking of the head revealing to be responsible for all the strange ongoings of late. Furthermore this shade, how did she gain access to the sanctuary? Unless the only missing sisters were Gywn and... Dee? Could this be sister Dee? Upon this possible realisation, Speaker Skiri asked as such and the shade eagerly gestured to herself, nodding to the words.\\n\\nAmong our confused looks to one another at the sight before us. The shade, sister Dee? Slashed the air, leaving a rift in its place to Glenumbera, gesturing to follow. Stepping through a marked path lay before us through the wilds...',},['Pitch']=0,['SizeY']=30,['Z']=26986,['Roll']=0,['Alpha']=1,['Color']=909996,['SizeZ']=30,['Id']=1316,['X']=22124,['SizeX']=26.456460,['Groups']=0,['Yaw']=2.181660,['Y']=20344,},[70]={['EffectType']=8502,['Contrast']=2.140000,['MetaData']={['title']='Week 44 - (Part B)',['message']='To where this shade of Dee stood. Her voice quiet like an echo in a storm. Explaining that she was forbidden to speak on Sithis\\' grounds and that herself and Dee\\'s real body needed help... Wait, real body?\\n\\nGoing on to tell, that Dee\\'s real body is lost in the Skyrim winds, and needed our help to find and reunite the pair. Only contacting us now due to taking so long to take form and only recently being able to reach through the sanctuary wards, both after many years.\\n\\nSlashing out another rift the chilling winds of Skyrim bled through. Finding ourselves south of the Frozen coast in snowy tundra. Where Dee\\'s body apparently lay below us, somewhere in the snow. As we dug around bare hands if need be the shade continued to explain the situation. Some sort of experiment had gone wrong all leading to this moment. Believing we had found something one brother dug around faster to uncover the mystery, to end up pulling out a frozen chunk of bear from the frozen drifts. Not exactly a desired outcome. Much digging later, finally! Finding a crow in hand under the snow. Both frozen in place with the rest of the body in tow. It was our sister!\\n\\nRecovering her from the snow the shade lay down close. Re-uniting with Dee herself as what looked like some life returned to Dee\\'s frozen body. Deciding best to take her some place warm as she lay sleeping, regaining her strength. Speaker Skiri suggested her newly finished sanctuary somewhat nearby in the region would be a good place to stay.\\n\\nSkiri\\'s newly unveiled Skyrim sanctuary in all its glory, much like all the sanctuaries it had everything we could need. Finding a warm place to set Sister Dee down, we let her rest.\\n\\nWelcome home dear sister. Just... stay away from the kitchen...',},['Pitch']=0,['SizeY']=30,['Z']=26957.942709,['Roll']=0,['Alpha']=1,['Color']=909996,['SizeZ']=30,['Id']=1317,['X']=22103.076606,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20344,},[71]={['EffectType']=8502,['Contrast']=2.900000,['MetaData']={['title']='Week 45 - (Part B)',['message']='That moment, a spark of interest caught this Psijic standing before us, wishing to know more of who we were.\\n\\nAs vague as he has been with us, we did such in return giving no useful information.\\nArguing back and forth for much time after, the Psijic stated he had had enough. Handing over gibberish message scroll. It seemed we past what ever test he was playing.\\n\\nHeading our separate ways, us to our home and the Psijic vanishing from sight. Hopefully we will not have to deal with him again, or any antagonising mages.\\nGathering around the gibberish written before us wondering what it could mean, it seemed almost no one could work out what it meant. Almost.\\n\\nTaking the scroll, brother Jonah stared for a little bit before reading the coded message for help and its instructions aloud. Yet even the decoded instructions \"Shine my Psijic light upon\" were just as cryptic.\\n\\nPondering over what this could mean and deciding to take the note to sister llia, a fellow Psijic herself who we hope could shed some light on the situation.\\nTraveling to her place, presenting her the message/instruction shortly after our greeting. \\n\\nReading it through and taking a moment to think before taking out a small blue glowing orb, holding it above the written page. As the blue light shone the ink faded, replaced by a map of Alinor followed by a Psijic eye over one of the homes.\\n\\nI think we just discovered our next move...',},['Pitch']=0,['SizeY']=30,['Z']=26895,['Roll']=0,['Alpha']=1,['Color']=141899,['SizeZ']=30,['Id']=1318,['X']=22057,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.225295,['Y']=20343,},[72]={['EffectType']=8502,['Contrast']=2.910000,['MetaData']={['title']='Week 45 - The annoying Psijic',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nA calm peaceful gathing that was just not meant to be. Idle chatter to each other, interrupted by brother Dathear running in with news to share.\\n\\nThe crazy mage, the Psijic, the very same who seemed to be everywhere around us, the very same who seems to know something of our missing brother Voralmo, has resurfaced one again.\\nRushing in to tell us, sprinting all the way from Anvil to the sanctuary in order to relay the information in time before he vanished once more.\\n\\nRelaying just enough information of his where-abouts in Anvil, before passing out of exhaustion from the sprint.\\nCarrying the brother into the dorms to rest, but immediately heading out wasting no time on this opportunity our doorstep had provided.\\nTo uncover a mystery of this Psijic and what had happened to our missing brother.\\nMounting up and riding for Anvil with haste, there was not a moment to spare. Reaching the entrance, our bitter sweet discovery did not take long.\\nThe robes, crazy rambling to any in audible range, distasteful attitude. All too well known to so many present, wishing to avoid the Psijic entirely.\\n\\nYet as per our task, strait towards the angry ramblings we rode.\\nObnoxious, rude, insulting. Are just some of the more pleasant words to describe him. Yet as a damned projection, there was little we could do.\\nMuch painfully annoying questioning proceeded. Seeming to be having fun at the deliberate frustration he was causing. Along with insultingly awkward and vague responses.\\nAs frustrations grew we cut right to the point asking if this Psijic knew Voralmo directly. Which we knew he did based of previous encounters.\\n..',},['Pitch']=0,['SizeY']=30,['Z']=26919,['Roll']=0,['Alpha']=1,['Color']=141899,['SizeZ']=30,['Id']=1319,['X']=22075,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.225295,['Y']=20343,},[73]={['EffectType']=8502,['Contrast']=2.500000,['MetaData']={['title']='Week 46 - The enigmatical mystic',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nGathering in the sanctuary, finally glad to see the back of chasing a pest of a mage around Tamriel and thinking through our next move. To follow the map to the marked home where Voralmo is believed to live in hopes of discovering what has happened to him.\\n\\nMentioning that Speaker Skiri had matters to attend in Alinor, she would be leaving us to conduct our investigation not too long after our arrival. With that, we set off. Stepping through a portal to the heart of Alinor with newly acquired map in hand, barely a local blinked an eye at us in our readied, mage guild related disguises.\\nKeeping as much of a low profile as possible while strolling through the city as we headed in the direction of the marked home. \\n\\nFinding ourselves stopped in our paths mid-way, an arrogant High Elf coming from the opposite direction took the pleasure to insult our existence for simply stepping foot within Summerset.\\nShortly after the barrage of insults from the elf began, a sudden pause came as his gaze met with Speaker Skiri. \\nFollowed by an exchange between the pair, as Skiri greets \"Magister Drohca\" who nearly immediately questions why she would be wasting her time around \"these things\" in Summerset when it would be best to \"keep a low profile and stick to matters at hand\".\\n\\nSkiri began to explain that she was simply showing the group the city, however Drohca took as little interest as possible. Interrupting, stating, that he had finished his \"important business with the proxy queen\" and will be at the inn here in Alinor. That Skiri should not keep him waiting. \\nAs Drohca left our view, confirming that this was the other matter Skiri had to attend, placed brother Jean in charge of the investigation going further',},['Pitch']=0,['SizeY']=30,['Z']=26853,['Roll']=0,['Alpha']=1,['Color']=78199,['SizeZ']=30,['Id']=1320,['X']=22026,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.228785,['Y']=20343,},[74]={['EffectType']=8502,['Contrast']=2.380000,['MetaData']={['title']='Week 46 - (Part B)',['message']='Heading onwards as Skiri departed, we soon found ourselves at the home marked on the map. Un-assuming like the rest in the city. \\n\\nAs Jean placed a hand on the door to pick it open, the handle shone a soft blue as the clunking of locks unlocking from within could be heard. It seemed he was expected?\\nYet after stepping in it quickly became clear no one had been home for many moons. Candles burnt out, dust, cobwebs all over.\\n\\nExploring within, many research journals could be found dotted about within the home, all illuding to something Voralmo was searching for...\\n\\nMany journals later, detailing failed attempts, different tests, results and failures. Yet still illuding to the main goal... intill...\\n\\nStepping into the main study an object visibly emitting static energy could easily spotted on the centre table, almost as if... it was trying to get our attention? Was that possible?\\n\\nAs we took a closer look, Jean recognised the object before him. The very mask that Voralmo would never remove in front of anyone, the very mask Voralmo\\'s daughter, known as Lightning resides.\\n\\nAs Jean carefully picked up the mask, it was clear he could hear someone from within it. Or he was acting crazy, looking at this seemingly one sided conversation.\\n\\nThe mask or Lightning... directed us to the corner desk, where a single book lay. The very first journal, explaining within the its pages the context behind what Voralmo has been searching for. The possible home realm that Lightning may have come from.\\n\\nPointing again to a keystone tucked behind a bookshelf, asking us to press. But, out of over due devilish fun, Lightning at first neglected to inform us that only a recognised hand could use the key stone without a stunning experience. \\n\\nThe last thing poor Hobbys was...',},['Pitch']=0,['SizeY']=30,['Z']=26827,['Roll']=0,['Alpha']=1,['Color']=78199,['SizeZ']=30,['Id']=1321,['X']=22007,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.228785,['Y']=20343,},[75]={['EffectType']=8502,['Contrast']=2.360000,['MetaData']={['title']='Week 46 - (Part C)',['message']='expecting was a stun sending him to the ground.\\n\\nHowever the job was done, the clunking to the other side of the room brought forth a lever from the wall. As Jean tugged the switch the fireplace shifted, revealing a door to a privet garden.\\n\\nTo the back, sat a privet lab where apparently almost all of Voralmo\\'s notes resided. Passing a suspicious energy shield to the lab and sliding the lab door open. Notes were scattered everywhere, yet together... they hold everything we need!\\n\\nGoing through the notes, one best not mention copying any work. Lightning, the mask? Was not pleased. Poor Hobbys couldn\\'t work out what way was up for a short time after.\\n',},['Pitch']=0,['SizeY']=30,['Z']=26803,['Roll']=0,['Alpha']=1,['Color']=78199,['SizeZ']=30,['Id']=1322,['X']=21988,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.228785,['Y']=20343,},[76]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='Week 47 - The unknown planes',['message']='A document of events of the brotherhood. Written by: Unknown \\n\\nAs our numbers grew in the sanctuary, it was not long before we were returning to Voralmo\\'s home in Alinor, heading back up to his lab and pondering over his notes and journals trying to decipher what we could.\\n\\nAlthough sister Lightning\\'s perspective into Voralmo\\'s obscure notes and work was a helpful aid, providing as much detail as she could to any questions we needed to throw her way despite not having definate ideas herself.\\nPulling all the books together along with Lightning\\'s insight we came to realise that collectively and spread across the journals were all the hints as to what Voralmo had done. \\nWho appears to have traveled to another realm as part of his research and may be unable to return.\\nWithin such a journal mentioned many preperations that Voralmo had made, including the use of a sigil stone and two crystals to assist opening and maintaining the portal. However the means of how was still much a mystery. \\nIt was a shame Sister Horns licking the sigil stone did not give the answer.\\n\\nAs some continued to ponder the journals, a few others exited the lab and began to inspect but dare not touch the stange energy field mentioned briefly in one of the journals.\\nThe shield glistened over the vegetation and within it shimmered a metalic pillar that stood shoulder high, but better yet to the back one of Voralmo\\'s journal mentioned crystals could be spotted laying in its holder. \\n\\nWith the pieces of this puzzle coming together as sister Horns brought out the sigil stone gathering infront of the shield wondering how to dispell it without reprocussion. \\nAlthough before we had much time to discuss sister Horns decided to act by tossing the sigil stone at the barrier.\\nThe stone flew...',},['Pitch']=0,['SizeY']=30,['Z']=27330,['Roll']=0,['Alpha']=1,['Color']=139942,['SizeZ']=30,['Id']=1338,['X']=22370,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.234021,['Y']=20288,},[77]={['EffectType']=8502,['Contrast']=2.580000,['MetaData']={['title']='Week 47 - (Part B)',['message']='...through the air with what short thoughts of disaster we could muster, the orb made contact with the barrier.\\nAs the barrier shattered and dissolved, the sigil stone floated into place above the metalic piller sparking to life throwing a beam of energy towards the crystal causing that too to radiate energy of its own accord.\\n\\nForming a portal obscuring its view. \\n\\nWithin our moment of relief that nothing worse had occured we stood infront of this newly opened portal, assuming these to be the same steps Voralmo had taken. Readying ourselfs, stepping into the unknown.\\n\\nUnnatural storms circled overhead as lightning strikes briefly lit up the desolate rockface before us. Occasionally lighting up the entrance to a cave just ahead. Following a series of tattered notes within these however were too degraded to read.\\nWalking further, the rocks above rapidly cracked and shifted causing a rockfall with... intent? Seperating us from Speaker Skiri who fortunately sounding okay on the other side, asking us to continue while she found her own way out.\\nRetracing out steps, then heading up along the cliff side reaching a rocky grassland with blocked off passages running off in different directions, along with a lit sacrafical alter with freash sacrifices near by.\\n\\nAmong it all, an odd stone peaked out that we had seen not long prior, the other of Voralmo\\'s crystals. \\n\\nLeaving it in place for now, our search lead us into the caves below. A twisting network of narrow caves that seemed to slowly seep into out minds... lit only by the glow of abundent mushrooms. \\nNavigating the caves was near impossible as it seemed to move before our eyes, following what tattered books we could find.\\n\\nDespite the lost echos of our group behind us we pressed on hoping Voralmo would...',},['Pitch']=0,['SizeY']=30,['Z']=27304,['Roll']=0,['Alpha']=1,['Color']=139942,['SizeZ']=30,['Id']=1339,['X']=22350,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.234021,['Y']=20288,},[78]={['EffectType']=8502,['Contrast']=2.700000,['MetaData']={['title']='Week 47 - (Part C)',['message']=' ...know how to help. That being based off what was readable from the notes we came across.\\nEventually we found ourselfs upon a door we had seem countless times, curious as to how it even got here. Wispering to us its question to us, none kwew the answer.\\n\\nA few guesses later with no luck, Speaker Orbeas decided to knock the door resulting in more success. As the door slowly shifted back, revealing our lost brother Voralmo, looking a bit worse for ware and unable to comprehend what was happening.\\n\\nWith no time to meet and greet properly we explained the situation and the crystal found above. At the word of the other crystal, Voralmo may have lost his marbles, but at least understood that it was time to leave.\\n\\nGrabbing what little he appeared to have left and rushing back out of the cave with us all in tow to the surface and re-finding everyone we could along the way.\\n\\nReaching the surface, reclaiming the crystal. However unfortunatley coming face to face with two dremora of the realm. \\n\\nAs they confronted, despite whatever objectives they once had they began to bicker with one another. Almost as if they forgot we were there. Comically ending in one pushing the other off the cliff.\\n\\nFinally taking notice of us, turning and approching as Speaker Skiri rejoined us. Although in all this time, Voralmo had been preparing the crystal who now defiently held it up to the dremora. Pulling us all back to Voralmo\\'s home.\\nAt last... Voralmo was home. Who seemed to not believe it himself, as everyone embraced his return. \\nHowever the celebration was nearly short lived as Speaker Skiri collapsed as her illusion faded, revealing a cut running down from her neck to her knee. \\nRushing her onto a bed Voralmo did the best he could to heal her with what little energy he had,...',},['Pitch']=0,['SizeY']=30,['Z']=27279,['Roll']=0,['Alpha']=1,['Color']=139942,['SizeZ']=30,['Id']=1340,['X']=22330,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.234021,['Y']=20288,},[79]={['EffectType']=8502,['Contrast']=2.410000,['MetaData']={['title']='Week 47 - (Part D)',['message']='...getting her to a stable condition. Advising Speaker Skiri to remain in his home to rest.\\n\\nExausted, Voralmo did the same. After all the puzzles and searching, Voralmo was home.',},['Pitch']=0,['SizeY']=30,['Z']=27252,['Roll']=0,['Alpha']=1,['Color']=139942,['SizeZ']=30,['Id']=1342,['X']=22311,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.234021,['Y']=20288,},[80]={['EffectType']=8502,['Contrast']=2.880000,['MetaData']={['title']='Week 48 - A collection of talent',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nTraversing the snowy tundra of Skyrim, we were to meet Speaker Skiri in her sanctuary.\\nShortly after each of use arrived at our varied times hearing chatter above us, Speaker Skiri came down greeting us. Who in turn presented the darkly dressed figure walking beside her. Giving her a nod to introduce herself.\\nConfidently standing in front of us all, the figure introduced herself as Silencer Lyssa and had come to us from the marshes of Murkmire to assist and over see an upcoming task.\\n\\nIn order to best approach our upcoming tasks, Silencer Lyssa wished to learn of each of our strongest talents in order to best apply our skills and plan ahead.\\nAs Lyssa came to each of us asking what we consider our talents to be, it became apparent that the hand had chosen its children well as a large range of talents were presented.\\n\\nThe skills as follows:\\nFirstly Speaker Skiri, presenting her skilful display in illusion. Jean spoke of his nimble daggers and use of poisons. \\n\\nVoralmo mentioned his somewhat diminished abilities due to mushrooms, yet offering his wide magical knowledge in its place. Looks-for-Flowers explained of his in depth history and alchemy knowledge.\\n\\nSheta, offering pure devotion and the qualities of a brotherhood assassin. miss V nearly as silent as always, believing that actions speak better than words. Offered her skills in the dark arts.\\n\\nLastly Seryn, offering her adaptable art of disguise and her archery.\\n\\nThe presentation of talents aside, it was time to find out what our task would actually be. Silencer Lyssa couldn\\'t have been more glad that someone finally asked.\\nBased off intel...',},['Pitch']=0,['SizeY']=30,['Z']=27211,['Roll']=0,['Alpha']=1,['Color']=809926,['SizeZ']=30,['Id']=1344,['X']=22278,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.195624,['Y']=20287,},[81]={['EffectType']=8502,['Contrast']=2.840000,['MetaData']={['title']='Week 48 - (Part B)',['message']='...from Speaker Orbeas, the nature of our upcoming mission was centred around the ice reach coven who operate within Skyrim. Who have also been discovered to be assisting and protecting the Morag Tong operations in Skyrim territories.\\n\\nNaturally, this cannot be allowed. \\n\\nAccompanied by Lyssa, we are to head to the two areas where we believe this ice reach coven makes camp. To infiltrate, liberate, and exterminate the ice reach coven and any Morag Tong support we find.\\n\\nWe are to move out when we hear the word. Where some would say we are in simple, idle wait, others would say more time to prepare for the challenge ahead.\\n\\nWith the evening coming to a close, Speaker Alice arriving to take a look at the sanctuary and proper re-meet and greet between us all beginning, some interesting news may be over heard of celebration and wonder.\\n\\nOn the theme of wonder,\\nthe trail for Sister Gywn, her previous contract was handed to Brother Jean, to see what clues he may find.\\n\\nAs well as Sister Horns appears to have done a runner with some of Voralmo\\'s research. The same research the lead to him being trapped in another realm. What purposes behind this act are still unknown.\\n\\nOn the theme of celebration,\\nSister Natanii proposed to Sister Mraaz, who happily accepted! Natanii spared no time drawing up designs of her dress for the occasion. Congratulations to the pair.\\n',},['Pitch']=0,['SizeY']=30,['Z']=27185,['Roll']=0,['Alpha']=1,['Color']=809926,['SizeZ']=30,['Id']=1345,['X']=22260,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.195624,['Y']=20287,},[82]={['EffectType']=8502,['Contrast']=3,['MetaData']={['title']='Mini event between week 48 and 49 - The icy exploration',['message']='A document of events of the brotherhood. Written by: Voralmo\\n\\nMyself and Ma... Speaker Skiri met with Silencer Lyssa in Skyrim. Upon an overlook to an entrance to our latest task. An old, frozen, Nordic structure. Held together by the ice in its walls.\\nGreeting one another, and taking a moment to admire the snow fall. Although Silencer Lyssa stated that she would rather the climate of Murkmrie. Lightning easily agreed, any climate warmer would be an improvement.\\n\\nBelieving that we were ready and that no one else was coming, we headed down the icey slopes to the opening where we invited ourselves inside and out of the snow. Taking in our surrounding, as the task was explained to us.\\n\\nAs per the orders from Speaker Orbeas and at our last meeting, our mission was to eliminate the ice reach witch by the name of \"Drodda\" who we have discovered to inhabit this place, and is actively assisting the Morag Tong, and their operations within Skyrim.\\n\\nI couldn\\'t help but chuckle at how similar the name was to another I knew of no relation, sharing a few details of the stuck up high elf known as \"Drocha\" as we headed deeper into the frozen ruin.\\n\\nNot much exploration later within, we reached the entrance to a chamber where a troll had made its home. Scouting the area out, it soon became clear avoiding it was not an option.\\nDespite the threat it could have posed, Lyssa, Skiri, and myself dispatched of it efficiently. However, the lingering effects of those mushrooms I had to eat became clear, causing my repeated casting of spells to exhaust me.\\n\\nHumiliatingly having to take up a shovel as a weapon to avoid exhaustion at the suggestion.\\nAs we pressed further in, avoiding what undead we could that strolled and littered the icy halls...',},['Pitch']=0,['SizeY']=30,['Z']=27148,['Roll']=0,['Alpha']=1,['Color']=155399,['SizeZ']=30,['Id']=1346,['X']=22236,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20287,},[83]={['EffectType']=8502,['Contrast']=2.820000,['MetaData']={['title']='Mini event between week 48 and 49 - (Part B)',['message']=' Although as interesting as they can be, they did get in the way quite often.\\n\\nEventually reaching a main hall, snow falling where the roof had caved in and over the central alter that was circled by three, very dead, important looking figures in their thrones.\\n\\nNo matter how great the urge from Lightning, it remained for the best that I didn\\'t poke them.\\n\\nMoving on and up after a brief moment of note taking an old, frozen door, was little trouble for us. \\nSoon shifting open, as Ma... Speaker Skiri melted the door open with an arcane flame in hand.\\n\\nFurther up and along, briefly stopping to take note of the unnatural ice, and looking at the unfortunate people who had been instantly frozen. Like a moment captured in a cold corridor of time.\\nAt last, we reached as far as we could go having exited a trap door to the courtyard above, there stood our target mid-ritual in the eye of an icy wind. \\n\\nSoon our opportune moment came. Skiri, Lyssa, and myself with what strength I saved, cut the Ice Reach witch down where she stood.\\n\\nWith a final look around to make sure nothing remained, our mission was complete.\\n',},['Pitch']=0,['SizeY']=30,['Z']=27120,['Roll']=0,['Alpha']=1,['Color']=155399,['SizeZ']=30,['Id']=1347,['X']=22217,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20287,},[84]={['EffectType']=8502,['Contrast']=2.880000,['MetaData']={['title']='Week 49 - Family misfortunate and dead drunken tales',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nOne by one we arrived gathering before the statue of our farther, taking the time to catch up with one another before the pending announcements came our way.\\nWith the looming feeling of unease growing between those who had an idea of most recent events as the chatter progressed, it was not too long till enough arrived to begin.\\nCommanding our attention, Speaker Alice presented a choice of which news we wished to hear first. \\nTrying to begin with the \"lighter side\", although one would have reason to wonder why Silver... Sakos, decided to interrupt immediately after and announce that sister \"Seryn is dead\". \\n\\nShocked, concerned, and confused looks were shared by all learning of this tragedy for the first time, as the present Speakers scolded the interruption shortly before they called Ja\\'zakar froward to explain the events he witnessed...\\n\\nAs Ja\\'azakar explained the tragedy, we learned of an old enemy from his time fighting in Cyrodill many moons ago. Who of which possessed a grudge against Ja\\'zakar that clearly stood the test of time.\\n\\nWith a planned act of brutal revenge, Ja\\'azakar\\'s old foe had targeted his daughter, and our sister, Natanni at their home. Although as one might expect, nothing ever... goes exactly to plan.\\n\\nThe attempt on Sister Natanni\\'s life was foiled, by none other than Sister Seryn coming to her aid just in time. Fending off Natanni\\'s near death and the attacker.\\nWith Natanni laying severely injured but thankfully alive, Seryn gave chase as the attacker fled while Sakos tended to Natanni. \\n\\nUnfortunately when Ja\\'azakar returned and picked up on their trail, Sister Seryn was found dead along the way. Sadly to add salt into the wounds...',},['Pitch']=0,['SizeY']=30,['Z']=27075,['Roll']=0,['Alpha']=1,['Color']=898997,['SizeZ']=30,['Id']=1348,['X']=22193,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20288,},[85]={['EffectType']=8502,['Contrast']=2.840000,['MetaData']={['title']='Week 49 - (Part B)',['message']='despite this being a personal attack, after Ja\\'zakar caught the attacker he discovered him to be a member of the Tong.\\n\\nThis attacker may now hang by a tree, but the dye is cast. Questions will be asked. The Tong will seek answers.\\nWith a home compromised and Natanni desperately in need of recovery it was decided to move her to the sanctuary to heal, and for security.\\n\\nHowever, let us not forget the deeds of our fallen Sister. May Seryn rest in the void.\\n\\nOn the actual lighter side, today we welcome two new blades Felerian and Rhylyssa. May they reap rewards and success for Sithis and the Nightmother.\\nWith the news shared for good or worse it was time to move onto the business at hand.\\nIt has recently come to light that a \"former brother\" has been caught stealing from the coffers of his own sanctuary. To fuel his drinking addictions, and is apparently now coming near to drunkenly spilling more important information.\\nThose around him currently take him for a drunken fool, but this breaking of tenants ends now!\\nLast seen on the outskirts of Anvil and as the nearest sanctuary, we rode out in search, taking it upon ourselves to set an example to all and eradicate this treachery.\\n\\nBeginning with taverns, it was not long before our search yielded fruit as we entered the central city tavern. As our former brother barely stood upright at the bar amoung other patrons.\\nCovering all possible exits once inside and generously compensated the bartender for the upcoming \"mess\", we made our move.\\n\\nAll it took was the blink of an eye. Blink, and you would miss it all. Everyone within lay dead, from stabbing to child decapitation with our former \"bother\" among them. \\nExcluding the bar tender of course.\\n\\nLet no tavern tale be told of us. Or suffer as the next example.',},['Pitch']=0,['SizeY']=30,['Z']=27049,['Roll']=0,['Alpha']=1,['Color']=898997,['SizeZ']=30,['Id']=1349,['X']=22173,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.199115,['Y']=20289,},[86]={['EffectType']=8502,['Contrast']=2.120000,['MetaData']={['title']='Week 50 - Merry Christmas\\n ',['message']='A document of celebrations of the brotherhood. Written by: Unknown\\n\\nHuddled around a fire, we drink and cheer, \\nfor the end of another year begins to draw near.\\nReflecting on work successfully done, \\nhowever we know there is more story to come.\\n\\nSnow may fall as these nights grow long,\\nbut what matters tonight is that we celebrate in song.\\nSilence may be our usual tone, \\nbut lets hope this night we are forgiven and get no more than an eye roll and groan.\\n\\nPerhaps the speakers could join in too?\\nJoin in the games, we\\'re playing a few!\\nThere may be prizes, what could they be?\\nWell of course chocolate coins you see!\\n\\nFestive games where we hide high and low,\\nbut why stop there lets have a fashion show.\\nDraw tickets to see what you might get, \\nbut the true prize is that we all met.\\n\\nCheers to all for this year, \\nI look forward to making more fond memories here.\\n\\nMerry Christmas and a happy new year.',},['Pitch']=0,['SizeY']=30,['Z']=27008,['Roll']=0,['Alpha']=1,['Color']=90699,['SizeZ']=30,['Id']=1350,['X']=22142,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20289,},[87]={['EffectType']=8502,['Contrast']=3.080000,['MetaData']={['title']='Week 52 - Year 1 to a close, heres to year 2!',['message']='(a jump ahead to the final week)\\n\\nThis brings a close to the very first year of these recaps. \\nI hope everyone enjoys reading all of them so far, and all to come.',},['Pitch']=0,['SizeY']=30,['Z']=26971.488876,['Roll']=0,['Alpha']=1,['Color']=115899,['SizeZ']=30,['Id']=1351,['X']=22115.605447,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.181662,['Y']=20290,},[88]={['EffectType']=8502,['Contrast']=3.300000,['MetaData']={['title']='Week 1-y2 - The \"great escape\"',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\nWith the turning of the new year thankfully contradicting the beginning of the previous, and with our celebrations coming to a close, it was time to steer our view to possibilities and success of the work ahead.\\n\\nHowever a moment before we look forward, promising news comes from the past. Speaker Orbeas\\' scouts have sent word from Skyrim, that all of our efforts have paid off having now eliminated all Morag Tong operations from the region!\\nWith Skyrim liberated from this threat, it was time to shift our long awaited plans into motion. Making good on our deal that we stuck much time ago with dear Rain, regarding her twin sister and our captive, River.\\nAs were the terms in exchange for her sister, Rain was to infiltrate into the ranks of the Tong in River\\'s place. To fill her shoes and act as our informant.\\nNot to be unreasonable we also provided training, and she will travel back with Meriath, so Rain is best prepared for the task. \\n\\nTaking the portal to our Dominion sanctuary to check the progress of her training, we encounter Rain and Meriath. Both are readied and prepared for the challenges ahead.\\nGoing over the details and what we expected one final time, there will be no confusion of what lay ahead. \\nThus with that said and done, they were ready to begin.\\nAlthough we could not simply release them into the wild find the Tong on their on accord could we? A proper, more believable send off was in order.\\n\\nWith that, we heard the upcoming mirage of Rain and Meriath\\'s escape.\\nThat they managed to escape during transport to an undisclosed location, narrowly avoiding recapture in the chaos that ensued. They would also be supplied with out dated information to further feed the deception.\\n..',},['Pitch']=0,['SizeY']=30,['Z']=26415.833264,['Roll']=0,['Alpha']=1,['Color']=20799,['SizeZ']=30,['Id']=1354,['X']=22415.461364,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.375614,['Y']=20521,},[89]={['EffectType']=4405,['Contrast']=1,['MetaData']={['message']='Year one',},['Pitch']=0,['SizeY']=40,['Z']=26954.162328,['Roll']=0,['Alpha']=1,['Color']=999999,['SizeZ']=40,['Id']=1355,['X']=22178.710180,['SizeX']=220,['Groups']=0,['Yaw']=2.181662,['Y']=20541,},[90]={['EffectType']=8502,['Contrast']=3.300000,['MetaData']={['title']='Week 1-y2 - (Part B)',['message']='They were also ordered to throw every possible surprise our way during their escaoe. It had to be real after all. \\n\\nSo the time came with instructions set, we set off on the trail where our thrill of the upcoming hunt began to rise. \\n\\nBefore we knew it the hunt was on! Rain and Meriath chose their moment well as they darted into the woods, the rest of us giving chase close behind.\\nAll manner of objects were thrown at one another, ever increasing in lethality from both sides as they grew nearer the western shores.\\nRocks and branches, daggers and axes, brute force tackles, to the most violent of spells were thrown without mercy.\\n\\nLucky onlookers could have easily confused the chaos for a miniature war. Perhaps not unlike the contracted war the year prior.\\nWith wounds on all sides of the conflict and the pair reaching the western shores \"escaping\" into the waters, they vanished from view as we headed home to \"reflect on losing our prisoners\". \\n\\nFor now however... we wait...\\n\\n\\n\\n\\nWe return home to a new unveiling of contracts, allowing us to pick one up when ever we please and as many as we desire from the dark ledgers across the sanctuaries...\\n\\nMay Sithis and the Nightmother smile upon our work.',},['Pitch']=0,['SizeY']=30,['Z']=26445.693264,['Roll']=0,['Alpha']=1,['Color']=20799,['SizeZ']=30,['Id']=1356,['X']=22437.301364,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.375614,['Y']=20521,},[91]={['EffectType']=8502,['Contrast']=2.900000,['MetaData']={['title']='Week 2-y2 - The time trial',['message']='A document of events of the brotherhood. Written by: Unknown\\n\\n\"Congratulations brothers for you have both been very busy this...\" CUT! \"No? Take two? *sighs* okay....\"\\n\\nCollecting in the Kavatch sanctuary main hall, we begin our classic good news and bad news endeavour from Speaker Alice once more.\\nFirstly, the good news. The roll out of the new contract system has been a great success and almost every contract this week has been completed.\\nThe bad news? That we \"Almost\"... completed every contract. Merely a single contract away from silent perfection.\\n\\nDespite this single thorn in our side, Speaker Alice gave us the chance to catch up and correct this outlier before it was too late.\\nPresenting the contract to us along with the chance for one of us to take all the glory with the final blow.\\n\\nThe remaining contract was a courier who regularly travels Glenumbra\\'s routes between Hag Fen and Aldcroft by the name of \"Melisa Gildrelle\".\\n\\nHowever for all of us to head out and find a target would be too simple a task would it not? Speaker Alice believed as much, issuing us an additional challenge along side the contract.\\nOur challenge? From the moment we stepped into Speaker Alice\\'s Sanctuary in Glenumbra via the portal, we had 30 minutes to find, and eliminate the target.\\nWith our challenge and potential glory all to play for, there was no count down quick enough to announce our determination. Each of us ready, raring, and eager to burst out of the Sanctuary gates, and so we did.\\n\\nTraveling first to Aldcroft to begin our hunt. Quickly formulating a plan to split and spread out up to cover more ground as efficiently as possible.\\n\\nFor those of us who stuck to the roads, found our target almost immediately while the others still looked in the country side...',},['Pitch']=0,['SizeY']=30,['Z']=26486,['Roll']=0,['Alpha']=1,['Color']=318498,['SizeZ']=30,['Id']=1365,['X']=22466,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.373869,['Y']=20520,},[92]={['EffectType']=8502,['Contrast']=2.860000,['MetaData']={['title']='Week 2-y2 - (Part B)',['message']='Despite the incredible early find, the just as fortunate opportunity to make the kill did not follow as quickly.\\nGiving us the run around if she knew it or not, passing through occupied settlements full of soldiers making her death an impossibility without disaster. \\n\\nGathering back up as a main group as each of us one by one found the target and lost the target over and over as she passed between settlements and open roads, time was waring dangerously thin.\\nNot just in time for Speaker Alice\\'s challenge, but in time to prevent the target from reaching Daggerfall city where the kill would truly be nearly impossible.\\n\\nFortunately our concerns were not realised. While Melisa travelled the roads just before the city, Jonah, the assassin of hour made the kill and hid the body.\\n\\nTraveling back to Speaker Alice\\'s sanctuary just in time, to witness Jonah\\'s promotion to executioner for his success. Congratulations brother.',},['Pitch']=0,['SizeY']=30,['Z']=26512,['Roll']=0,['Alpha']=1,['Color']=318498,['SizeZ']=30,['Id']=1366,['X']=22488,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.373869,['Y']=20520,},[93]={['EffectType']=8502,['Contrast']=4,['MetaData']={['title']='Week 3-y2 - The other side of the coin',['message']='A document of events of the Morag Tong. Written by: Unknown\\n\\nWe chosen few gathered in our personal hideaway, designed and dedicated only for the very best agents of the order of the Morag Tong. \\nWhere we re-greeted one another from our missions and travels as each of us arrived home, checking back in with Knower Edryven to notify him of our recent successes not long after each of our arrivals.\\n\\nAs we came to socialise with one another, it became apparent not all was as one would first expect after hearing the conversation coming from above. \\nWondering if what we believed was about to come to pass.\\nAlas our suspicions were soon confirmed, as our long lost associate River walked down the staircase. Returning to us since vanishing in Narssis many months ago.\\nMeeting up with her one by one, we learned of her ambush and entrapment at the hands of the Dark Brotherhood.\\nWho of which encaged her all this time.\\n\\nOnly returning to us now through a narrow death bolt for freedom during prisoner transport to an unknown location, with the assistance of her new found friend and Brotherhood deserter, Meriath.\\nWho both seemed to barely manage a narrow escape together off the shores of Auridon.\\n\\nHowever after our brief re-introduction, River and Meriath were to report in for medical aid to fix up their very clear injuries. \\nLeaving us all in much suspense and eagerness to also learn of their insights and travels when they were to return.\\n\\nAs we waited for their return with the desire to pass the time, several games of dice was in order and went as one might expect. \\nCheers of victors winning their spoils, to dice rigging claims. Pouting of lost coins and boastful celebration. Many coins were won and lost that day.',},['Pitch']=0,['SizeY']=30,['Z']=26548,['Roll']=0,['Alpha']=1,['Color']=33300,['SizeZ']=30,['Id']=1367,['X']=22518,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.424483,['Y']=20521,},[94]={['EffectType']=8502,['Contrast']=2.840000,['MetaData']={['title']='Week 4/5-y2 - Cargo ship mysteries',['message']='A document of events of the Brotherhood. Written by: Unknown\\n\\nUrging to place lingering thoughts to rest and please Mother in the process, Speaker Skiri had a mission for us all. \\nHolding it\\'s presentation till everyone had arrived, hearing of hints towards Stonefalls as we socialised. Awaiting the others to join us.\\n\\nWith the everyone here at the Kavatch sanctuary soon after, we collectively hear of the trouble within Stonefalls requiring imminent attention before it soon escalates beyond control.\\n\\nPresenting a shipping manifest to all of us, Speaker Skiri also spoke of the equivalent trade ship it belonged to and how the family has had business with it in the past.\\nFollowing a lead from Lilandrill where this shipping manifest was acquired, and when the ship had previously docked, and now knowing it will next drop anchor in Stonefalls, it was now time for our intervention.\\n\\nThe contents of the cargo on board was not disclosed to us however Speaker Skiri expressed concern if this cargo were to reach it\\'s assumed destination within Stonefalls.\\nThis concern in mind, our task is to head to the northern shores of Stonefalls before the ship was due to dock at midnight as per its schedule, and take control of the onboard cargo. To capture it, or preferably destroy it under blazing flame.\\nIf the crew resist our efforts, we are to deal with them as we wish. If the captain of the vessel is present, identified as female with incredibly pale skin, she is to be captured.\\n\\nWith the briefing at its end and everyone ready for departure, Speaker Skiri pulled out a scroll to open a portal taking us above the beachside cliffs of the region. To where we shall lay in wait for our boat to arrive.\\n\\nArriving atop the cliff expecting to over look an empty beach gave us quite...',},['Pitch']=0,['SizeY']=30,['Z']=26586,['Roll']=0,['Alpha']=1,['Color']=839926,['SizeZ']=30,['Id']=1369,['X']=22549,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.393067,['Y']=20522,},[95]={['EffectType']=8502,['Contrast']=2.890000,['MetaData']={['title']='Week 4/5-y2 - (Part B)',['message']='the contradiction. Looking to one another in befuddlement at the sight of the boat anchored at the shore.\\n\\nRealising time was against us we set of down the cliff with haste. Signalling Aeriel, Jean, and Saran to scout the nearby camp, while Speaker Skiri ordered  the rest of us to follow her inside the vessel itself.\\n\\nDespite the three who checked the camp found nothing of interest, the rest of us boarded the scene of a massacre. Blood and corpses decorated the ship where ever we cast our eyes while in search for the cargo we seeked.\\n\\nIn the depths of the ship, the most unexpected occurred. A single sailor, still dying from his wounds. Jumping at the chance we ask him everything we could, and with his last breaths he spoke of the cargo aboard being lost during a battle at sea.\\n\\nAs Speaker Skiri sighed in relief that the cargo was gone, we pulled a note off the sailor\\'s body before getting off the ship as fast as we could.\\n\\nRegrouping below the cliff, Speaker Skiri read the recovered note aloud. Talking of a \"Pale lady\" or \"Misses\" who resides in Funglegrotto, where the lost cargo was destined to arrive, and that the attack on their ship was... expected?\\nWith this new found scope of this operation in mind, we follow up, heading to and into the depths Funglegrotto while Speaker Skiri stood guard outside. Wishing to not to re-experience anything from our previous visit.\\n\\nFrom the moment we stepped in, we all felt the chill travel up our spines. Following two sets of footprints, while hearing ominous voices and a childlike giggling which echoing throughout the halls as we ventured further within. \\n\\nReaching a gate and a pale woman stood just beyond it, threatening a wrath of flames for our intrusion. However before a conflict could ignite we came to realise...',},['Pitch']=0,['SizeY']=30,['Z']=26614,['Roll']=0,['Alpha']=1,['Color']=839926,['SizeZ']=30,['Id']=1370,['X']=22573,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.393067,['Y']=20522,},[96]={['EffectType']=8502,['Contrast']=2.890000,['MetaData']={['title']='Week 4/5-y2 - (Part C)',['message']='who this woman was, recognising her from an illusion by Speaker Skiri long ago. Recognising her, as Skiri\\'s long dead mother Nyrelia.\\n\\nConfronting her with this Sparked further curiosity from both sides, each party wishing to know more of the other as... Ophelia? Skiri\\'s lost sister appeared behind her mother. Leaving us now questioning how either of them were alive.\\n\\nWith everyone now present we learn of how dearly Ophelia has missed her fellow sister, and how Nyrelia Lied to her daughter by convincing her of Skiri\\'s death, and thus began the battle of persuasion over Ophelia, to convince her to stay with her mother or to come with us to see her sister skiri.\\n\\nAs the battle of words progressed the already strained tensions began to flare, reaching the limit as the threats began to fly. Ending with an arrow let loose, knocking Nyrelia out and to the ground. \\n\\nEnsuring Ophelia was not too distressed we brought her and her mother back to Skiri\\'s sanctuary, holding her mother in a cell for the time being.\\n\\nWith the day coming to a close with Skiri and Ophelia reuniting once more, Ophellia is officially welcomed to the family. Welcome home sister.',},['Pitch']=0,['SizeY']=30,['Z']=26641,['Roll']=0,['Alpha']=1,['Color']=889926,['SizeZ']=30,['Id']=1371,['X']=22595,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.393067,['Y']=20522,},},}"
