R["fx__eu__@jarpals__82"]="{['Version']=1767,['TS']=1644531167,['Effects']={[1]={['Contrast']=1,['Y']=21980,['Groups']=0,['SizeX']=300,['Alpha']=1,['SizeZ']=400,['Color']=949999,['SizeY']=400,['EffectType']=1011,['X']=29783.511485,['Yaw']=1.609194,['Pitch']=0,['Z']=98360.098064,['Id']=1068,['Roll']=0,},[2]={['Contrast']=1,['Y']=21958,['Groups']=0,['SizeX']=300,['Alpha']=1,['SizeZ']=400,['Color']=949999,['SizeY']=400,['EffectType']=1011,['X']=29780.607732,['Yaw']=1.384046,['Pitch']=0,['Z']=97698.005691,['Id']=1069,['Roll']=0,},[3]={['Contrast']=1.500000,['Y']=21528,['Groups']=0,['SizeX']=1660,['Alpha']=0.920000,['SizeZ']=5700,['Color']=197304,['SizeY']=5700,['EffectType']=432,['X']=26123.931679,['Yaw']=2.998476,['Pitch']=0,['Z']=97877.665698,['Id']=1070,['Roll']=0,},[4]={['Contrast']=1.740000,['Y']=18876,['Groups']=0,['SizeX']=240,['Alpha']=0.660000,['SizeZ']=440,['Color']=90099,['SizeY']=440,['EffectType']=9,['X']=32082.479150,['Yaw']=3.106686,['Pitch']=0,['Z']=94586.680521,['Id']=1083,['Roll']=0,},[5]={['Contrast']=1,['Y']=20012,['Groups']=0,['Alpha']=1,['SizeX']=35.456456,['SizeY']=50,['EffectType']=8503,['Color']=102439,['Z']=98631.150565,['Yaw']=6.030113,['SizeZ']=50,['X']=25888.480870,['Pitch']=1.151917,['MetaData']={['message']='Before you lays the Dark Ledger. It contains a few contracts and word to sign the Ledger if a contract has been taken care of...\\n\\n\\n|cac1616Contract I|r |c000000\\nStormhold a village in Shadowfen. A sister went above and beyond in tracking the person down, only to find that her brother has been taken as a slave by dunmer. His addled mind can\\'t stop wanting to praise and please his mistress. Kill this dark elf slave-keeper, and her house guest too, if you must. \\n\\n|cac1616Contract II|r |c000000\\nA Nord woman in Shad Astula, her instructors are concerned that she may get a little violent with her magic. One of them offered us a chance to send another soul to Sithis.\\n\\n|cac1616Contract III|r |c000000\\nA scholar named Tenlethon in Halimorion\\'s Villa in Russafeld, his servant has asked for his death. Probably wants to take over his estate.\\n\\n|cac1616Contract IV|r |c000000\\nThe locals have arranged a small group to stop the kwama mining in the Darkshade Caverns. They believe the animals also deserve a place to live and breed. One of them preformed the sacrament and seeks our aid. End Formeman Llothan in any way you see fit. As long as it halts the operation in this cavern.\\n\\n|cac1616Contract V|r |c000000\\nIntel has been gathered in the past few weeks from the nearby ruinLabyrinthian. The reason the dead march here is because they are attracted to a local magical source. A dangerous foe is expected to be faced. Venture towards Shademother\\'s Haven, bring some backup and cleanse this place of the foul undead magic.\\n               \\n\\n                    |t150:150:esoui/art/icons/rep_darkbrotherhood_64.dds|t\\n',['title']='|cac1616Dark Ledger|r |c000000',},['Id']=1099,['Roll']=0,},[6]={['Contrast']=1,['Y']=21763,['Groups']=0,['Alpha']=1,['SizeX']=26.456456,['SizeY']=30,['EffectType']=8503,['Color']=999394,['Z']=97511.693613,['Yaw']=2.336996,['SizeZ']=30,['X']=21235.308179,['Pitch']=1.570971,['MetaData']={['message']='\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n                         |t150:150:esoui/art/icons/rep_darkbrotherhood_64.dds|t\\n\\n\\n\\n\\n                                We Know',['title']='A mysterious note...',},['Id']=1100,['Roll']=0,},[7]={['Contrast']=1,['Y']=19994,['Groups']=0,['Alpha']=1,['SizeX']=6.456456,['SizeY']=30,['EffectType']=8503,['Color']=102439,['Z']=98674.489112,['Yaw']=3.387684,['SizeZ']=30,['X']=26107.552717,['Pitch']=1.553343,['MetaData']={['message']='\\n\\n\\n<The letter seems to contain a cargo ships manifest.\\n\\nRoutes,\\n\\nPassengers,\\n\\nCargo,\\n\\nPrices of harbours,\\n\\nand all sorts of information that belong.>',['title']='Cargo ship manifest',},['Id']=1101,['Roll']=0,},[8]={['Contrast']=1,['Y']=19971,['Groups']=0,['Alpha']=1,['SizeX']=26.456456,['SizeY']=30,['EffectType']=8503,['Color']=102439,['Z']=95574.008320,['Yaw']=0.820305,['SizeZ']=30,['X']=26249.211723,['Pitch']=1.570971,['MetaData']={['message']='\\n<It\\'s contents seem to describe a private thank you note for the Speaker.\\n\\nSpotting the handwriting and the outline of lipstick below one might assume someone of nobility wrote the words, most likely a female.\\n\\nThe letter itself contains some lusty details about the nights activities.\\n\\nDetails of another meeting seem to written in code.>',['title']='Love letter',},['Id']=1102,['Roll']=0,},[9]={['Contrast']=1,['Y']=19998,['Groups']=0,['Alpha']=1,['SizeX']=26.456456,['SizeY']=30,['EffectType']=8503,['Color']=102439,['Z']=96032.353187,['Yaw']=5.258677,['SizeZ']=30,['X']=26228.035564,['Pitch']=0.349066,['MetaData']={['message']='\\n\\nThe book seems to be covered in a dried up sticky substance.\\n\\n\\nThe beginning of the title is vaguely faded. One could make out the words \".....Book of Silken Sheets.....\\n\\n\\nWhen you glance your eyes on the index of the book you could see this is going to be a manual on a very specific act....\\n\\n\\n...very very specific...>',['title']='A sticky tome',},['Id']=1103,['Roll']=0,},},}"
