R["fx__na__@tonyactsout__46"]="{['Effects']={[1]={['Alpha']=1,['Y']=14652,['X']=58475.915211,['SizeZ']=50,['Color']=174854,['EffectType']=8503,['Yaw']=4.712389,['Roll']=0,['Z']=88563.628695,['SizeX']=46.456456,['Id']=1013,['MetaData']={['message']='\\nby Blades Captain Nezchrynliir\\n\\n\\n\\nCome one and all and sit by the hearth,\\n\\nLet me tell you a tale of the hero of the empire,\\n\\nGrab your bottles of brandy and mugs of ale,\\n\\nCome hear this legendary tale.\\n\\n\\n\\nIt began in an era known as the third,\\n\\nThe empire was in a state of chaos and fear,\\n\\nWhen from the shadows this great hero then stirred,\\n\\nTo end the conflict with a future unclear.\\n\\n\\n\\nHe fought for the empire without any disdain,\\n\\nThe blades he gathered from their shattered refrain,\\n\\nHis name was to be a legend in the tale of Tonius,\\n\\nFrom the great bloodline of the grand Imperius.\\n\\n\\n\\nMehrunes Dagon had risen from his oblivion plane,\\n\\nTo set the land alight with his chaotic rage,\\n\\nYet with his mighty beard and loyal blades,\\n\\nTonius put an end to the scheming fades.\\n\\n\\n\\nHe saved a great empire yet what was the cost,\\n\\nWith this victory what would truly be lost?\\n\\nInto the fourth he so valiantly strode,\\n\\nWith the blades who with him rode.\\n\\n\\n\\nA dragon so terrible had finally come,\\n\\nTo end all life from the land it had sprung,\\n\\nAn empire in ruin whos will had been undone,\\n\\nAt the hand of a force whose song had often been sung.\\n\\n\\n\\nAlduin came and thrust his kin in the north,\\n\\nRaising them from slumber and calling them forth,\\n\\nA land torn in two by mortal decree,\\n\\nA tenative peace he chose to oversee.\\n\\n\\n\\nHe fought alongside a vampire so fair,\\n\\nSerena was her name with her long raven hair,\\n\\nHis heart she did capture without any fight,\\n\\nShe was indeed to him a great light.\\n\\n\\n\\nHe learned to control a powerful thu\\'um,\\n\\nFrom a dragon who chose men for his boon,\\n\\nYet in the end they fell by his blade,\\n\\nPaarthurnax lay in his cold grave\\n',['title']='The Tale of Tonius Imperius, Vol. I',},['Contrast']=2.880000,['Pitch']=5.759587,['Groups']=1,['SizeY']=50,},[2]={['Alpha']=1,['Y']=14652,['X']=58475.453239,['SizeZ']=50,['Color']=225262,['EffectType']=8503,['Yaw']=1.570796,['Roll']=0,['Z']=88641.384258,['SizeX']=46.456456,['Id']=1014,['MetaData']={['message']='\\nby Blades Captain Nezchrynliir\\n\\n\\n\\nWhen the fate of the world came to it\\'s time,\\n\\nTonius rose up and gave a true hopeful sign,\\n\\nIn sovngarde the battle drew close,\\n\\nYet Tonius was the one the will of Talos chose.\\n\\n\\n\\nWith this era saved he was again a great hero,\\n\\nHis blades now many from nearly zero.\\n\\nMoving again he went to the second,\\n\\nA time of great strife where the lands fate had been reckoned.\\n\\n\\n\\nIn the land of the the dark elves,\\n\\nFrom which great chaos in mysteries did he delve.\\n\\nHe fought near the great heart of Lorkhan,\\n\\nTo save the fates of both mer and men.\\n\\n\\n\\nAnd when the smoke of this conflict would settle,\\n\\nTonius had shown great courage and mettle.\\n\\nFrom there he stopped another great plot,\\n\\nOf princes in three who within they fought.\\n\\n\\n\\nThis was a tale of treason and power,\\n\\nThat he helped a great cause prevail in their darkest hour.\\n\\nFrom there he went on to the lands of khajiit,\\n\\nFor dragons had risen that he would defeat.\\n\\n\\n\\nHe fought their kind with steel and blades,\\n\\nRestoring an order who came before his own,\\n\\nHe saw to it that their legend has been resown,\\n\\nIn the history of the lands did he once again wade.\\n\\n\\n\\nAgain in skyrim in the harsh and cold north,\\n\\nAgainst vampires he came riding forth,\\n\\nStopping their plans he once again showed his name,\\n\\nIn every era it was with Talos he came.\\n\\n\\n\\nAgain he laid bare his unfortunate foe,\\n\\nWith his blades he became their great woe,\\n\\nTheir plans had been shattered like long frozen steel,\\n\\nYet there was more cogs in his fates wheel.\\n\\n\\n\\nMehrunes again rose up from his plane,\\n\\nTo take the land yet hubris his bane,\\n\\nThis plot Tonius brought once again low,\\n\\nThe priest of this order dealth a fatal blow.\\n',['title']='The Tale of Tonius Imperius, Vol. II',},['Contrast']=2.140000,['Pitch']=0.610865,['Groups']=1,['SizeY']=50,},[3]={['Alpha']=1,['Y']=14652,['X']=58475.042759,['SizeZ']=50,['Color']=428899,['EffectType']=8503,['Yaw']=4.712389,['Roll']=0,['Z']=88716.830105,['SizeX']=46.456456,['Id']=1016,['MetaData']={['message']='\\nby Blades Captain Nezchrynliir\\n\\n\\nOne last battle lay before Tonius\\'s resolve,\\n\\nThe blades once again became quite involved,\\n\\nMolag Bal tried to conquer the land,\\n\\nYet he met his end at Tonius\\'s hand.\\n\\n\\n\\nIn the end it was time to rest,\\n\\nA heavy heart beat within Tonius\\'s breast,\\n\\nHe came to the temple of Talos to pray,\\n\\nOn this very fateful of days.\\n\\n\\n\\nTalos granted him his reprieve,\\n\\nYet of his body did Tonius leave,\\n\\nNow trapped in a statue made of cold stone,\\n\\nDovahkiin still sits on her throne.\\n\\n\\n\\nNow us blades must take up his will,\\n\\nFight in his name with the same passion and zeal,\\n\\nEvery foe our forces shall kill,\\n\\nFor Tonius\\'s journey has traversed the full turn of fates wheel.\\n\\n\\n\\nThis is the tale of the grandmaster of the order,\\n\\nSome would say on madness his mind did border,\\n\\nYet for all who yet live he gave us his life,\\n\\nIn an age of unending war and strife.',['title']='The Tale of Tonius Imperius, Vol. III',},['Contrast']=1.880000,['Pitch']=5.672320,['Groups']=1,['SizeY']=50,},},['Version']=1746,['TS']=1625679224,}"
