R["fx__eu__@king_shadoweye__59"]="{['TS']=1638309744,['Effects']={[1]={['Pitch']=0,['EffectType']=4503,['SizeX']=140,['Z']=49486,['SizeY']=460,['Groups']=0,['X']=58837,['Yaw']=4.014257,['Alpha']=1,['Color']=324799,['SizeZ']=460,['Id']=1010,['Y']=12434,['Roll']=0,['Contrast']=1,},[2]={['Pitch']=0,['EffectType']=27,['SizeX']=940,['Z']=49302,['SizeY']=960,['Groups']=0,['X']=58613,['Yaw']=0,['Alpha']=1,['Color']=999999,['SizeZ']=960,['Id']=1011,['Y']=12242,['Roll']=0,['Contrast']=2.800000,},[3]={['Pitch']=0,['EffectType']=26,['SizeX']=500,['Z']=49308,['SizeY']=1,['Groups']=0,['X']=58616,['Yaw']=2.879793,['Alpha']=1,['Color']=999999,['SizeZ']=500,['Id']=1013,['Y']=12237,['Roll']=0,['Contrast']=1,},[4]={['Pitch']=0,['EffectType']=8502,['SizeX']=66.456456,['Alpha']=0,['Z']=46964,['Color']=102439,['Groups']=0,['X']=58000,['Yaw']=6.021386,['SizeY']=130,['MetaData']={['message']='May those students not be forgotten, but let the days of teaching remain in the past.\\n\\nAlways seek to learn, and try to think ahead to prevent possible disaster, \\n\\nAlways try, keep an ever watchful eye, for it may never just be over.\\nAnd little distractions, for there will not be any lucky clovers.\\n\\nMay this mask become who I am, and who I am become the mask, \\nfor appearance does not matter. \\nmay its values always be remembered, for what it has and does do,\\nfor it saved one life, sparking joy, and company.\\n\\nIf the days of teaching return again, may they be joy, and prepare for it to happen again.',['title']='A reminder...',},['SizeZ']=130,['Id']=1025,['Y']=13053,['Roll']=0,['Contrast']=1,},[5]={['Pitch']=0,['EffectType']=4405,['SizeX']=80,['Alpha']=1,['Z']=46966,['Color']=999999,['Groups']=0,['X']=57990,['Yaw']=6.021386,['SizeY']=22,['MetaData']={['message']='      A\\n   reminder',},['SizeZ']=22,['Id']=1027,['Y']=13101,['Roll']=0,['Contrast']=1,},[6]={['Pitch']=1.570971,['EffectType']=392,['SizeX']=560,['Z']=52129,['SizeY']=560,['Groups']=0,['X']=58507,['Yaw']=4.712389,['Alpha']=0.800000,['Color']=999999,['SizeZ']=560,['Id']=1028,['Y']=21173,['Roll']=0,['Contrast']=0.970000,},[7]={['Pitch']=0,['EffectType']=30,['SizeX']=380,['Z']=51946,['SizeY']=380,['Groups']=0,['X']=58699,['Yaw']=4.712389,['Alpha']=1,['Color']=499,['SizeZ']=380,['Id']=1030,['Y']=21174,['Roll']=0,['Contrast']=3.180000,},[8]={['Pitch']=0,['EffectType']=35,['SizeX']=460,['Z']=52377,['SizeY']=460,['Groups']=0,['X']=58611,['Yaw']=4.712389,['Alpha']=1,['Color']=277199,['SizeZ']=460,['Id']=1031,['Y']=21172,['Roll']=0,['Contrast']=1,},[9]={['Pitch']=0,['EffectType']=4500,['SizeX']=200,['Alpha']=1,['Z']=54481,['Color']=919494,['Groups']=0,['X']=55788,['Yaw']=3.836234,['SizeY']=420,['MetaData']={['houseid']=56,['owner']='@Tracer848',},['SizeZ']=420,['Id']=1033,['Y']=21619,['Roll']=0,['Contrast']=1.250000,},[10]={['Pitch']=5.585054,['EffectType']=621,['SizeX']=110,['Z']=49116,['SizeY']=110,['Groups']=0,['X']=56830,['Yaw']=2.967060,['Alpha']=0.740000,['Color']=808100,['SizeZ']=110,['Id']=1034,['Y']=13112,['Roll']=0,['Contrast']=4,},[11]={['Pitch']=1.570971,['EffectType']=878,['SizeX']=240,['Z']=47075,['SizeY']=160,['Groups']=0,['X']=57980,['Yaw']=6.108652,['Alpha']=1,['Color']=253953,['SizeZ']=160,['Id']=1036,['Y']=12056,['Roll']=0,['Contrast']=0.800000,},[12]={['Pitch']=4.780457,['EffectType']=4405,['SizeX']=160,['Alpha']=1,['Z']=47067,['Color']=999999,['Groups']=0,['X']=57972,['Yaw']=2.968805,['SizeY']=40,['MetaData']={['message']='   Wipe \\nyour feet',},['SizeZ']=40,['Id']=1037,['Y']=12057,['Roll']=6.281440,['Contrast']=1,},[13]={['Pitch']=5.612979,['EffectType']=8502,['SizeX']=50.456456,['Alpha']=1,['Z']=47729,['Color']=607998,['Groups']=0,['X']=56265,['Yaw']=1.389282,['SizeY']=55,['MetaData']={['message']='The following documentation has been created, via referencing own findings through study and experimental practice, and already known notes with the psijic libraries.\\n\\nTo \"practice\" time, someone must first understand it. There are many theories about time, that everything that happens always happens, that it can\\'t be changed, using time magic creates multiple realities. Truth be told someone could go all day explaining all the theories.\\nThe truth behind the \"theory\" of time however, truly is what you make of it, and reguardless, it can be manipulated to the casters requirement.\\n\\nDangers:\\nIf the use of time is not properly managed, the results can be beond description. Under NO SITUATIONS should anyone attempt to use time magic without an instructor of notable experiance. - anyone reading, please ask for details.\\n\\nThrough focus as mentioned above, understanding is the first step, on how it works, manipulating time, infulences the very existance of the object, and someone must be able to first visualise the purpose of the casting as it is shown to you as you cast, and then to project onto the object what it once was or what it will be, and command time to do it. - requiring much focus\\n\\n*the writing trails off... this instruction guide is evidently unfinished*',['title']='The study and practice of \"Time\"',},['SizeZ']=55,['Id']=1041,['Y']=13117,['Roll']=0.085521,['Contrast']=1.930000,},[14]={['Pitch']=0,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=46891,['Color']=102439,['Groups']=0,['X']=56362,['Yaw']=1.357866,['SizeY']=30,['MetaData']={['message']='I don\\'t understand. No one tells me why. I can\\'t do what everyone else is doing. I can\\'t go and play outside. I CAN\\'T EVEN GO OUTSIDE.\\nEverything always comes to me from out there... I just want to see where it comes from. This has been months....\\n*several pages missing*\\nThe night after I decided to sneek out, mum and dad baricaded the house to stop me getting out again and some strange people came around in shiny armour today. They were arguing with mum and dad. I think it has something to do with me. Apparently I don\\'t look right? People come from outside and teach me things sometimes too. They are all so boring... except for that magic teacher. He seems to like me. He looks odd though, funny blue and gold robes with an eye in the middle.\\n*several pages missing*\\nmum and dad cast lots of spells on me today... it didnt feel right... they said I could go outside now. \\nI tried playing with the other kids.... but they aren\\'t very nice. \\nI managed to get along with some, but one day while we were messing with magic I broke the spells mum and dad put on me. They looks at me as if I was a monster.\\n*the page has been torn out apart from the bottom line stating \"they will pay for this\"\\n*several pages missing*\\nI found a ball mask, I put it on, and some people did not recognise me... not that it matters now...\\n*the rest of that page, and the following page is torn out*\\nappearances.... why are they so important here....\\nIt matters not. I do not need them. Or those people...\\nToday I take my leave, I will take for myself what some are trying to stop from being given to me.',['title']='old mysterious diary',},['SizeZ']=30,['Id']=1042,['Y']=13355,['Roll']=0,['Contrast']=1,},[15]={['Pitch']=0,['EffectType']=946,['SizeX']=76,['Z']=48351,['SizeY']=76,['Groups']=0,['X']=57026,['Yaw']=3.141593,['Alpha']=1,['Color']=997848,['SizeZ']=76,['Id']=1043,['Y']=13144,['Roll']=0,['Contrast']=4,},[16]={['Pitch']=4.761258,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=46981.915464,['Color']=102439,['Groups']=0,['X']=57173.484100,['Yaw']=5.195845,['SizeY']=30,['MetaData']={['message']='Vol. one of experimental study of non-deadra or non-divine associated relms.\\n\\nContext:\\nAt a rough time frame of one hundered years before the artaeum incident, (being previous rejected and corrupted students opening an oblivion gate in the heart of artaeum, causing a large explosion)\\nmy students were tasked with either creating or traveling to a new relm of reality. Inspiring this new research.\\n\\nThe ability to travel to other relms is not un-heard of and is in fact fairly common and regularly practiced. \\nHowever the uniqueness of a relm that has no association to a deity, or that was created by a powerful mage is near enough un-heard of.\\n\\nIn these volumes I will be documenting the research and tests to discorver these relms, most notable the orginal relm like this that was discovered, being the origon relm of my daughter Lightning.\\nDay / test one: first thoughts and ideas.\\nDuring the origonal task, my students combined their energy to open a portal to another demention. The same skills I taught them. Leaving two factors to consider: a) one of the students was already aware of this relm that we traveled to, and made it the destination - very unlikely.\\nOr b) there was no destination in mind and it was chance that this new relm was found.\\n\\nMy first attempts will be to replicate this process and to see what results are yeilded.\\nTest one:\\nAs expected the results were less than helpful. Replicating the process to an exact copy resulted in opening a portal to the known \"dead lands\" ruled by merunze dagon.\\nA second try resulted even less promising. The opened portal lead to another place on nirn. Spesifically the ebon heart kitchens. Although my thought of cookies my have intefeard with this test. - must examine\\nA third attempt showed an ancient aylid ruin. \\nEnd of Vol one.',['title']='Demensional studies Vol 1',},['SizeZ']=30,['Id']=1046,['Y']=13062,['Roll']=6.236061,['Contrast']=1,},[17]={['Pitch']=1.570971,['EffectType']=7,['SizeX']=40,['Z']=48347,['SizeY']=40,['Groups']=0,['X']=57026,['Yaw']=4.712389,['Alpha']=1,['Color']=595919,['SizeZ']=40,['Id']=1047,['Y']=13080,['Roll']=0,['Contrast']=1,},[18]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=47461.033379,['Color']=102439,['Groups']=0,['X']=56540.550798,['Yaw']=5.061455,['SizeY']=30,['MetaData']={['message']='Day 5 of experimentation.\\n\\nThe attempts of replicate a spesific method of portal creation in my extended attempts to travel to a mostly unknown realm have so far have presented a wide range of results. These results from the most recent tests are as follows:\\n\\nImages of Meridea - deity of infinate energies, \\na portal to Vulkah Guard and Skywatch,\\na portal to cold harbor, followed by images of Molag ball - deity of domination,\\nimages of Vermina - deity of dreams and nightmares,\\na portal to artaeum - a second time,\\na dense forest - I assume to be Graftwood or Valenwood.\\n\\nThe results of this particular method of portal generation appear to be random, which could suggest that this experiment could take much more time than anticipated. If nessesory more efficient methods portal generation will be resorted too for slightly sooner results. As recommended I will attempt to focus on an object I know to be present at the destination. This will likely show a promising result but will bring all testing to an end promptly - hence a last resort.\\n\\nHowever, despite these seemingly unsuccssesful results, \\nit is curious that every so often I am presented with images of deadra, so far spesiffically deadra deities. \\n\\nThis is a new possible use for this portal method.\\n\\nWhy this is happening semi-frequently, is yet unknown - requires more research.\\nFurther direct testing will resume at a later point.\\nFirst an attempt to see a pattern in the findings will be made.\\nSecond, research on the spesific deities that were shown.\\nEnd of Vol.2',['title']='Demensional studies Vol 2.',},['SizeZ']=30,['Id']=1050,['Y']=12179,['Roll']=0,['Contrast']=1,},[19]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=47026.539296,['Color']=102439,['Groups']=0,['X']=57650.812795,['Yaw']=4.188790,['SizeY']=30,['MetaData']={['message']='Day 14\\nExperimentation had stalled for the past few days, dew to external research not providing many answers at first, and recieving the same results as before. Seemingly random locations, and semi frequent images of deadra and divine deities. Matron skiri sugested that someone could be intefearing with my research when I asked for her opinion on my findings. To test this I created a barrier around me, to see what incomming magica could be potentially be doing this. Unexpectedly, presenting the following results:\\n\\nIncomming energy, IS affecting the results that the portals are showing. When a portal was generated, incomming background energy within the world appears to alter the result.\\n\\nAfter realising this, more direct external research was applied with more direction, spesifically about the most recent magical activity. \\nThese most recent events have actually been related to cults worshiping a deity. These cult related activities turned out to be accosiated with:\\nMerunze dagon, Meridea, molag ball. \\n- An exact match in order - in the same order, to the results I recived during first testings.\\nThis information was discovered by word of mouth first, then looking into the psijic archives of documented data on magical activities.\\n\\nAll other images of deities, being Vermina, and most recently Nocternal, could be related to possible events else where that has not been documented. - Privetly documented. \\nAs for the random locations, They could possibly linked to places that are linked to the casters subconcious. As all \"random\" locations shown, are technically linked by myself. - requires more research\\n\\nConsidering these latest findings, a place without any influencial background energy must be found to conduct more tests to see what results are presented. \\nEnd of Vol. 3',['title']='Demensional studies Vol. 3',},['SizeZ']=30,['Id']=1058,['Y']=13078,['Roll']=0,['Contrast']=1,},[20]={['Pitch']=0,['EffectType']=4502,['SizeX']=140,['Z']=49576,['SizeY']=460,['Groups']=0,['X']=58559,['Yaw']=2.988004,['Alpha']=1,['Color']=995553,['SizeZ']=460,['Id']=1059,['Y']=12442,['Roll']=0,['Contrast']=1,},[21]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=48802.579518,['Color']=102439,['Groups']=0,['X']=59167.011241,['Yaw']=4.974188,['SizeY']=30,['MetaData']={['message']='Day 19\\nAfter the most recent discovery that background magic within the world is affecting the results of the portal experiment,\\n(and possibly linked to memory -  this still needs further confirmation)\\nspesifically the destination of the portal.\\nSearch for an area that is mostly unaffected by outside magic has proven near. Artaeum once was a sutible location, however now that people enter and leave more freely, that is no longer the case.\\n\\nPractical tests will resume after a new suitable testing location has been found.\\n\\nDay 38\\nI believe I have found a suitible location. A secluded spot on the west side of kenarthis roost. The island\\'s distance from the main land should also be advanatgous.\\nKenarthi test one: fail - repeated images of storms were visible in the generated portal. Likely to do with the mowmer activities off the coast. \\nA new location will saught out.\\n\\nDay 48\\nVery little progress has been made. All first assumed, secluded spots to be suitable are proven otherwise.\\nfurther locations tested: Artaeum, islands off Summerset and other dominion terriorties, warded mages guild in cold harbour, Gold Coast, Hews Bane, Stros\\'mi-ki, eyevaya. \\nAll gave random locations and images of dieties as a result of generating the portal with the previously mentioned method. \\n\\nProgress will pause for the time being to think of a new approach on these experiments.\\n\\nDay 50\\nI believe I have a solution, I will attempt to create a suitable environment myself. I will manipulate the magical energies within my own testing area, closer to my own home, and either block outside magic from entering or completely devoid the area of magic. \\nTests will then be conducted and results recorded.\\nEnd of Vol. 4',['title']='Demensional studies Vol. 4',},['SizeZ']=30,['Id']=1060,['Y']=13066,['Roll']=0,['Contrast']=1,},[22]={['Pitch']=0,['EffectType']=4500,['SizeX']=200,['Alpha']=1,['Z']=54506,['Color']=507997,['Groups']=0,['X']=55526,['Yaw']=2.761111,['SizeY']=400,['MetaData']={['houseid']=9,['owner']='@NeruNeru',},['SizeZ']=400,['Id']=1064,['Y']=21621,['Roll']=0,['Contrast']=1,},[23]={['Pitch']=0,['EffectType']=959,['SizeX']=162,['Z']=51678,['SizeY']=162,['Groups']=0,['X']=58272,['Yaw']=3.141593,['Alpha']=1,['Color']=957755,['SizeZ']=162,['Id']=1066,['Y']=21401,['Roll']=0,['Contrast']=4,},[24]={['Pitch']=0,['EffectType']=645,['SizeX']=560,['Z']=52271,['SizeY']=560,['Groups']=0,['X']=59075,['Yaw']=1.308997,['Alpha']=1,['Color']=999998,['SizeZ']=560,['Id']=1068,['Y']=21336,['Roll']=0,['Contrast']=1,},[25]={['Pitch']=0,['EffectType']=961,['SizeX']=860,['Z']=54086,['SizeY']=680,['Groups']=0,['X']=58202,['Yaw']=4.712389,['Alpha']=1,['Color']=998247,['SizeZ']=680,['Id']=1069,['Y']=21393,['Roll']=0,['Contrast']=2.250000,},[26]={['Pitch']=5.190609,['EffectType']=540,['SizeX']=60,['Z']=51970,['SizeY']=1140,['Groups']=0,['X']=58623,['Yaw']=2.310816,['Alpha']=1,['Color']=995444,['SizeZ']=1140,['Id']=1070,['Y']=21411,['Roll']=3.710570,['Contrast']=1.740000,},[27]={['Pitch']=0,['EffectType']=4498,['SizeX']=1720,['Z']=53783,['SizeY']=640,['Groups']=0,['X']=57293,['Yaw']=1.396263,['Alpha']=1,['Color']=999998,['SizeZ']=640,['Id']=1071,['Y']=21452,['Roll']=0,['Contrast']=1,},[28]={['Pitch']=6.140068,['EffectType']=8502,['SizeX']=46.456456,['Alpha']=1,['Z']=48474,['Color']=385799,['Groups']=0,['X']=56072,['Yaw']=1.396263,['SizeY']=55,['MetaData']={['message']='An old art lost to the ever flowing time. Known to by little few, practiced by fewer, taught by nearly none. Unless you find yourself amoungst the oldest of the old, the first of the magical orders, may you unfortunatly only dream of learning the oldest of ways.\\nFor a master of mysticisum, the magical laws of nature are a bendable reality. For magical energies its self are mearly wet clay to your creativity.\\nFrom pulling places together, via a portals like travel telemitary. To making objects float and move in all manner of ways by controling it\\'s gravity.\\n\\nThe energy within spells becomes yours to control, be that magical sheilds or strikes of yours or cast by another. The ability see the world around you, like no other. \\nTo see what cannot be seen, for Nirn\\'s mysteries are now yours to discover.\\n\\nTo understand the mind is a good acomplishment, but to hear and speak to your fellow minds is no longer beond comprehension.\\n\\nThe flow of time may be ever out of full control, but in the ways of old it becomes a cold metal to be bent with great force. To pause your efforts or to reverse..but time will forever flow onwards.\\n\\nTo project your existance to another, to see and hear afar from you. To seek and learn from here, there and where-ever. \\n\\nBut be warned to those who persue these ways, for when you practice this purest magical creativity, you put at risk your sanity. For to practice mysticisum you must forget your thoughts of logical explininity. And embrace abstractness and obscurity. For only this will aid in mystic sorcery. So practice with care, and under guided instruction, or forfit your mind and gain mental corruption.',['title']='Mastery of mysticisum',},['SizeZ']=55,['Id']=1074,['Y']=13141,['Roll']=0,['Contrast']=1,},[29]={['Pitch']=0,['EffectType']=923,['SizeX']=162,['Z']=46966.978215,['SizeY']=162,['Groups']=0,['X']=57244.484861,['Yaw']=1.836086,['Alpha']=1,['Color']=998448,['SizeZ']=162,['Id']=1117,['Y']=13203,['Roll']=0,['Contrast']=3.420000,},[30]={['Pitch']=0,['EffectType']=923,['SizeX']=102,['Z']=47009,['SizeY']=102,['Groups']=0,['X']=57717,['Yaw']=0,['Alpha']=1,['Color']=998449,['SizeZ']=102,['Id']=1118,['Y']=13045,['Roll']=0,['Contrast']=2.880000,},[31]={['Pitch']=0,['EffectType']=923,['SizeX']=162,['Z']=47710,['SizeY']=162,['Groups']=0,['X']=56218,['Yaw']=1.399754,['Alpha']=1,['Color']=998445,['SizeZ']=162,['Id']=1203,['Y']=13206,['Roll']=0,['Contrast']=3.420000,},[32]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=50355.401446,['Color']=102439,['Groups']=0,['X']=57317.644599,['Yaw']=4.712389,['SizeY']=30,['MetaData']={['message']='Day 52\\n\\nSucsess. After the last two days of testing, artificially creating an area void of magic was sucsessful. Although a specially designed ward to prevent magic and other life forms from entering was required.\\n\\nWithin the area void of magic, opening the portal with the previously mentioned method presented new results now that outside interfearances are no longer a factor.\\n\\nThe results / sightings of the first fore tests:\\n\\nPortal method - allowing your own elemental energies to converge and flow freedom within the portal frame, allowing the currents power to guide you, rather than redirecting the energies.\\n\\nA) A lush grassland and flowers, with what appears to be random pockets of spontanious combustion, not unlike small versions of a volcanic eruption.\\n\\nB) A mirror representation of Nirn, covered in ice and snow, man, elf, and ice achronoc living together.\\n\\nc) A rocky terain, some vegitation dotted about, some un-identifiable structures, the sky appears to be a continuous storm.\\n\\nd) An area of divine light within an atherial plains of lush forest. What appeared to be spirits of some kind floated within and around the trees.\\n\\nTesting will continue, the results of result three will be a focus. \\n\\nWithin day 52, result three, designated as \"storm\", has re-appeared repeatedly. Under the current portal conditions previously mentioned, it would suggest that a visual memory focus assists in creating the destination, like more advanced portals for normal travel. I will now make next stage preperations to step through and briefly explore \"storm\".',['title']='demensional studies Vol. 5',},['SizeZ']=30,['Id']=1213,['Y']=21255,['Roll']=0,['Contrast']=1.750000,},[33]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=53207.017691,['Color']=102439,['Groups']=0,['X']=55344.821195,['Yaw']=0,['SizeY']=30,['MetaData']={['message']='Preperations: \\n\\nestimated exploration time: 18 hours, \\nempty note books and ink,\\nfood and water,\\nback pack,\\nstaff,\\ntwo enchanted gems one to assist keeping the ward surrounding the portal operational to prevent anything reaching nirn, and another to place inside the portal to also assist keeping it open.\\n\\nDetection spells, if anything other than myself tries to enter the portal to return to nirn, it will close the portal immediatly intill I re-open it.\\n\\nWorse case situation: I will write a pre planned letter asking for assistence, to possibly be delivered at spesific times and locations around nirn, with other strict instructions, but not limmited too, including basic descriptions of appearence to deliver too, when the letter should be delivered, a code phrase \"I am sure you had something to tell me?\", because I am sure he has something to tell me, I must find out what when I return.\\nThis letter will be delivered by a trusted student of mine, despite being a stuck up high elf, should be able to follow the instruction.\\n\\nThe letter will explain in the form of a puzzle \"If this is being read, then there is a high probability that I may require some major assistance, and that something has likely gone wrong with my work which is preventing my return. To what extent things have gone wrong, I am unsure at the time of writing. As much assiting information as possible should be within my research journals. \\nI am also sure that sp..*eraced name* had something to tell me?\\nP.S. please check on lightning for me, as if this is being read, I have been gone much longer\\n than planned\"\\n\\nGoals:\\nTo explore and discorver, to learn what the place is, and identify it, to see if it is Lightning\\'s home realm, to bring back anything that can be of use.',['title']='Preperations:',},['SizeZ']=30,['Id']=1214,['Y']=21457,['Roll']=0,['Contrast']=1,},[34]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=53502.583625,['Color']=102439,['Groups']=0,['X']=55284.558989,['Yaw']=6.195919,['SizeY']=30,['MetaData']={['message']='If you are reading this, I believe that you are capable of following these strict sets of instructions. Under no circomstances can these instructions can be diverted from.\\nAppon succsess you will be compensated for your efforts and time.\\nThe following instructions may only be opened if you do not hear from myself for two weeks after reciving this.\\n\\n=============================================================\\n1) Attire in your psijic robes\\n2) You are to travel (but not limmited to) areas with more population concerntration (as assisting location list will be provided)\\n3) Ask the those of the area the code phraise \"Do you have something to tell me? I cannot remember what\" \\n4) Do not hand over the letter under any situations, unless the person you are speaking too is familier with myself, understands what it means, and they seeked yourself out instead.\\n5) Do not alter or deviate from the instructions\\n6) Do not persue anyone you may lead into a confused confrontation with.\\n7) Do not cheat, or use any other external psijic tools or artifacts.\\n8) Continue to follow these instructions in a continuous loop intill the task is completed.\\n\\nYou will be heavily compensated for your efforts providing succsess, in the form of a recommendation for promotion within the order, assuming you accepted these terms.',['title']='Disaster scinario instructions copy.',},['SizeZ']=30,['Id']=1215,['Y']=21457,['Roll']=0,['Contrast']=1,},[35]={['Pitch']=1.570971,['EffectType']=7,['SizeX']=40,['Z']=48150.882988,['SizeY']=40,['Groups']=0,['X']=56135.810000,['Yaw']=4.712389,['Alpha']=1,['Color']=595918,['SizeZ']=40,['Id']=1221,['Y']=13083,['Roll']=0,['Contrast']=1,},[36]={['Pitch']=0,['EffectType']=4547,['SizeX']=460,['Z']=52275.015673,['SizeY']=480,['Groups']=0,['X']=59104.259824,['Yaw']=4.537856,['Alpha']=1,['Color']=997569,['SizeZ']=480,['Id']=1222,['Y']=21346,['Roll']=0,['Contrast']=0.320000,},[37]={['Pitch']=4.705408,['EffectType']=8502,['SizeX']=29.456456,['Alpha']=1,['Z']=47239,['Color']=124099,['Groups']=0,['X']=56325,['Yaw']=2.181662,['SizeY']=37,['MetaData']={['message']='Observations and research of the rescued baby girl.\\nWritten by Voralmo\\n\\nThis young baby girl that myself and my students rescued a few moons back has peaked the interest of the rest of the order. No one, myself included, appears to be able to  identify... even what she is.\\n\\nHer appearance partly resembles that of a high elf in form with light but not pale skin, however visible thin streaks of blue / white lines that resemble lightning bolts are visible all over the skin, that rest within what seems to be a dark blue outline.\\n\\nWhen in very close proximity to metal, she seems to \"react\". Small bolts of electricity resonate from within her and reachout for the metal. The same can be said when in pysical contact with water.\\nAlso, anything that appears to distress her, or, what could be seen as a possible threat, also seems to be a conduit for these electrical shocks. Currently no display of control over these appears to be present.\\n\\nHer natural nature so far is very playful and lively. Which considering the situation she was just rescued from, I am most greatful for this.\\n\\nShe seems to display enthusiasum for magic, rejoycing and entertained when witnessing it. In addition, she seems to have slightly raised levels of natural magic resistence.\\n===============================\\n(written two weeks after inicial observations)\\nCollectivly myself and my students have named her Lightning.\\nI have made it my responsibility, and joy to protect and raise her. As well as find out more about her. Over the past two weeks Lightning has grown quickly, and has started to show very basic control on lightning magic. \\nAll previous findings written here still remain.\\n',['title']='Dusty research journal',},['SizeZ']=37,['Id']=1226,['Y']=13111,['Roll']=0,['Contrast']=1.680000,},[38]={['Pitch']=0,['EffectType']=26,['SizeX']=500,['Z']=54268.001681,['SizeY']=1,['Groups']=0,['X']=55632.564538,['Yaw']=3.759439,['Alpha']=1,['Color']=999999,['SizeZ']=500,['Id']=1234,['Y']=21448,['Roll']=0,['Contrast']=1,},[39]={['Pitch']=0,['EffectType']=27,['SizeX']=829,['Z']=54260.072259,['SizeY']=829,['Groups']=0,['X']=55626.564625,['Yaw']=3.141593,['Alpha']=1,['Color']=999999,['SizeZ']=829,['Id']=1235,['Y']=21447,['Roll']=0,['Contrast']=2,},[40]={['Pitch']=0,['EffectType']=4405,['SizeX']=1200,['Alpha']=1,['Z']=53396.502414,['Color']=999998,['Groups']=0,['X']=54497.829485,['Yaw']=1.396263,['SizeY']=80,['MetaData']={['message']=' general objects of curiosity, \\ntransmutation station, display cases, \\n          work station equipment',},['SizeZ']=80,['Id']=1239,['Y']=21447,['Roll']=0,['Contrast']=1,},[41]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=53344.988298,['Color']=102439,['Groups']=0,['X']=56158.365092,['Yaw']=4.712389,['SizeY']=30,['MetaData']={['message']='A log of the affects post contact. Written by: Voralmo\\n\\nContext:\\nMy student Arryon who posseses a promising talent in alchemy took it upon himself to work on an elixer to magically increase the \"life span\" of objects. Primerally food items as a focus.\\nOne day despite myself making it clear my expertiese was not his field he insisted I came to witness some testing.\\nArriving in the lab, Arryon and Emeraldi, through some way or another made and error. When combining two chemicals, the container broke apart and a gas filled the room. As a result, myself, Arryon and Emeraldi contracted a somewhat \"mild\" form of vampirisum. All future testing on the previously mentioned idea was discontinued.\\n\\n\\n===========================\\nAs time has progressed it has become more clear what the current developing affects are becoming. Such as:\\n\\nHarsh sun light - As time has progressed, bare skin in direct sunlight has become more uncomfertable, but not unbareable. Fires also feel warmer / more intence.\\n\\nfangs - small fangs have developed.\\n\\nhunger - fortunatly not typical vampire hunger. However, a hunger for either blood or sweet related foods? - possibly a result of the cookies being tested on\\n\\nslightly hightened senses? - Unable to confirm, my use of mysticisum has aided my senses for as long as remembered.\\n\\nmist - I seem to slowly be able to create a mist like appearence with practice',['title']='Journal of accidental alchemical vampirisum.',},['SizeZ']=30,['Id']=1248,['Y']=21424,['Roll']=0,['Contrast']=1,},[42]={['Pitch']=5.585054,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=53580.859392,['Color']=102439,['Groups']=0,['X']=56117.985323,['Yaw']=4.537856,['SizeY']=30,['MetaData']={['message']='During their task to create a portal to, and then explore, another place of existance, my fore students students between them found their way into a realm unlike any other. A constant storm loomed above, rocky terrain, some plant life, purpose built areas and civilization.\\n\\nStepping within the portal, the realm felt... \"off\", finding our selfs on a cliff over-looking a small civilization within the rocky grass terrain. Some smaller buildings could be seen, as well as what I would describe, as an alter.\\n\\nWe observed the locals gathering around this \"alter\", as someone appeared to be force-ably dragged upto, and held upon a slab. As the chanting began, a bot of lightning struck the one on the slab, as he (we think \"he\") screamed in pain as he slowly disolved.\\n\\nSome... thing? Then proceded to walk down the same path, and then proceded to place a baby on the slab. \\nMyself and my students were already horrified at what we had seen, only amplified further as things progressed. \\n\\nA sound of a portal opened behind me, as I turned, I found myself alone. Turning and looking back down, seeing my fore students standing around the baby ready to defend it. The magical battle ensued as I watched from above, unsure what my next move should be. \\n\\nQuickly becoming clear my students were outnumbered, outmatched, and heavily injured, finally making up my mind, I jumped off the cliff side diving down, opening a portal below. Flying through the portal, slamming down infront of our adverseries, using the momentum from the fall to force them all back in one energized blast.\\n\\nRapidly opening a portal and pulling everyone back up to the cliff, we wasted no time heading back to artaeum...\\n\\nWith a rescused, young baby girl.',['title']='The unexplainable realm: written by Voralmo',},['SizeZ']=30,['Id']=1253,['Y']=21585,['Roll']=0,['Contrast']=1,},[43]={['Pitch']=6.007423,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=54243,['Color']=102439,['Groups']=0,['X']=54741,['Yaw']=2.886775,['SizeY']=30,['MetaData']={['message']='Around one hundered years ago, (insert a eso date)\\n\\nAs time progressed since rescuing Lightning, many students had come and gone by now origonally seeking my teaching, thankfully my primary five were consistant throughout.\\n\\nTheir skills progressed brilliantly and I could not have been more proud of them and their dedication, so I began to prepare their \"final exam\" in a manner of description. To collectively create a magical display of immence power and control. The creativity of how, was up to them.\\n\\nThey planned and practiced with care and attention till the day came. As others gathered to watch above on the cliff side, my students headed down to the beach and began. Together between the five of them using magic from descrutction to mystisisum, they created a massive and beautiful, moving painting of Summerset that looked like it was touring the isles from location to location, yet this was no vision, it was like moving paint on a canvas.\\n\\nAs the display went on, a second group of what turned out to be some of my failed students rushed onto the beach, disrupting the display causing it to become unstable. As well as opening an oblivion gate near by. \\n\\nQuickly the combat began, the other psijics atop the cliff jumped in to deal with the gate and the oncoming deadra, while my students dealt with the rouges.\\n\\nUnfortunately not even the most un-reasonable would have expected the five of them to maintain such a display while in combat. As the battle ensued the magic become more unstable, at the hight of the combat, the shock wave from the oblivion gate closing proved to be too much for my already exausted students, as one by one they became too injured to fight the mass of magic became critical. ',['title']='The Artaeum incident: Written by Voralmo (P1)',},['SizeZ']=30,['Id']=1254,['Y']=21586,['Roll']=0.006981,['Contrast']=1,},[44]={['Pitch']=6.007423,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=54236,['Color']=102439,['Groups']=0,['X']=54709,['Yaw']=2.886775,['SizeY']=30,['MetaData']={['message']='The releasing energy created a blast that either immediatly killed, or mortally injured almost all of the students present, and those without the ability to protect themselfs.\\n\\nIt took many years to rebuild after this crisis. I was only barely able to save my own daughter by transfuring her essence and binding her into my mask. Now under my protection, she is still alive. Although it is not quite the same. \\n\\n====\\n\\n*newer ink can clearly be seen below*\\n\\nTime went on and Lightning started to, and then fell into a sleep like trance around fifty years ago. After my attempts to find out why, I found only dead ends, believing there was no more I could do.\\n\\nUntill recently, during what I call \"the library incident\" the magical explosion that my failed attempt (to create what I call a time stone), somehow had the right properties to wake my daughter lightning back up.\\n\\nI will make this right for her as best as I can.',['title']='The Artaeum incident: Written by Voralmo (P2)',},['SizeZ']=30,['Id']=1255,['Y']=21585,['Roll']=0.006981,['Contrast']=1,},[45]={['Pitch']=4.712564,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['Z']=54186.362243,['Color']=102439,['Groups']=0,['X']=54584.668070,['Yaw']=2.792527,['SizeY']=30,['MetaData']={['message']='During a test to my students - (that will be noted in more detail within another journal), one of them known as Kinladair, surprised me with a rather unique method of generating portals.\\n\\n\\n\\nUpon asking him a few days after, after the unexplainable realm events took place, how he developed it, his responce was facinating.\\n\\n\\n\\n\"ah of course, I was reading some texts about how the use of portals have evolved over the years, I may have miss-understood them, as I took parts of methods explained in different texts, and made them my own. Accidently creating something new\"\\n\\n- Kinladair\\n\\n\\n\\nAccording to Kinladair\\'s point of view, \\n\\n\"I didn\\'t really think of the desination, I ended up channeling my own elemental energies into creating the portal frame, and reached out to any realm of existance that was not our own\"\\n\\n\\n\\nThis interests me highly, as I personally have not heard this done before, I must conduct more study to this.\\n\\n----------\\nTo assist with my research I will infuse a depleated sigil stone with some of the energies emmitted by the portal that I choose to explore.',['title']='Experimental portals',},['SizeZ']=30,['Id']=1256,['Y']=21421,['Roll']=0,['Contrast']=1,},[46]={['Pitch']=5.525712,['EffectType']=8502,['SizeX']=55.456456,['Alpha']=0,['Z']=47813.174956,['Color']=102439,['Groups']=0,['X']=56242.514516,['Yaw']=1.396263,['SizeY']=52,['MetaData']={['message']='The dwemer were able harness a blend of machanics and sorcery so perfectly that has not been seen since they vanished. But how?\\n\\nMy attempt to recreate their work in the form of a shock spider was succsesful. However despite this most of the components were already intact and constructing the construct was \"relitively\" simple.\\n\\nThe dwemer appear to partly power their constructs with soul gems, and in such a way that can be argued that they are being brought to life.\\n\\nIs this process alterable? Instead of giving \"life\", to a metal construct, could a metal construct give life to a more organic life without stepping the line into necromancy?\\n\\n- Travel to dwarven ruins to find what remins of their technology to see if this theory is plausable',['title']='Dwemer reaserch',},['SizeZ']=52,['Id']=1271,['Y']=13113,['Roll']=0,['Contrast']=2.410000,},[47]={['Pitch']=0,['EffectType']=4405,['SizeX']=359,['Alpha']=1,['Z']=46712.839534,['Color']=999998,['Groups']=0,['X']=56761.730693,['Yaw']=6.073746,['SizeY']=20,['MetaData']={['message']='get \"things\" here',},['SizeZ']=20,['Id']=1298,['Y']=12135,['Roll']=0,['Contrast']=1,},[48]={['Pitch']=0,['EffectType']=4405,['SizeX']=220,['Alpha']=1,['Z']=53701,['Color']=999999,['Groups']=0,['X']=55380,['Yaw']=4.712389,['SizeY']=40,['MetaData']={['message']='Star gazing',},['SizeZ']=40,['Id']=1299,['Y']=22314,['Roll']=0,['Contrast']=1,},[49]={['Pitch']=0,['EffectType']=4500,['SizeX']=200,['Alpha']=1,['Z']=54215.242976,['Color']=515899,['Groups']=0,['Id']=1324,['Yaw']=4.883431,['SizeY']=420,['X']=55913.336801,['SizeZ']=420,['MetaData']={['houseid']=82,['owner']='@Jarpals',},['Y']=21619,['Roll']=0,['Contrast']=1.250000,},},['Version']=1766,}"
