R["oh__@litani.1432"]="{['Version']=1767,['Key']='oh__@litani.1432',['TS']=1644623599,['na']={[65]={['O']=19034,['D']='The love of my soul mate is buried here.',['C']=1.043000,['N']='Electro-shroom Grove',},[34]={['O']=19034,['D']='\"The Cat House\" is a secluded lover\\'s retreat for only the most exclusive clientele -- the proud Alfiq of Elsweyr!',['C']=1.007000,['N']='The Cat House',},[4]={['O']=19034,['D']='The office of Litani Shije\\'athra.',['C']=1.025000,['N']='Litani\\'s Office',},[5]={['O']=19034,['D']='The offices of Litani Shije\\'athra, in Alik\\'ir.',['C']=1.025000,['N']='Sand Suite',},[70]={['O']=19034,['D']='For her service to Queen Khamira, the Lunar Halls were gifted to Litani Shije\\'athra; she came to call this her home for many years, living in seclusion after the fall of House Kodesh.\\n\\nThe middle hall is a memorial for my father, MW.\\n\\nHe was the victim of American capitalism on August 2nd, 2011 when he died from a birth defect in his heart. He was denied care when he needed it because he couldn\\'t pay -- \"pre-existing condition.\" He was 49.\\nEat the goddamn rich.\\n#workingclasssolidarity',['C']=1.007000,['N']='Khamira\\'s Gift',},[8]={['O']=19034,['D']='Welcome to Shady Stitching! \\nAlterations made while you wait.',['C']=1.041000,['N']='Shady Stitching',},[9]={['O']=19034,['D']='This museum houses some of the first treasures and artifacts that Litani Shije\\'athra, or Litani \"Gem Soul,\" the orphan of Anequina turned assassin, turned property magnate, accumulated during her noteworthy lifetime. \\n\\nThe building itself is the first place that Litani ever truly called \"home;\" considering how prolific her real estate portfolio became, that marks this as a unique gem in the midst of gold.\\n\\nWalking tours daily; guided visits by appointment.',['C']=1.030000,['N']='First Gem Gallery',},[18]={['O']=19034,['D']='Welcome to Warm Sands, a taste of spicy Elsweyr in the northern cold of Wayrest! \\n\\nThis establishment is the property of Litani Shije\\'athra, an enigmatic Khajiit known for her hospitality and creating unique spaces for folks to enjoy. ',['C']=1.007000,['N']='Warm Sands',},[83]={['O']=19034,['D']='\"The Vault\" is the treasure house of Litani Shije\\'athra, a shadowy figure whose elusivity makes it hard to know when -- if ever -- she\\'ll be home.',['C']=1.007000,['N']='The Vault',},[22]={['O']=19034,['D']='Welcome to Rolls of Fish! \\n\\nPlease seat yourself.\\nAsk about today\\'s catch!\\n(Prices adjusted seasonally)',['C']=1.007000,['N']='Rolls of Fish',},[23]={['O']=19034,['D']='One of her many secluded hideaways, \"The Garden\" serves as the central-Tamriel meeting place -- and occasional workshop -- for Litani Shije\\'athra and her network of... contacts.',['C']=1.007000,['N']='Litani\\'s Garden',},[25]={['O']=19034,['D']='One of the many skooma dens and contact points for the network of the elusive Litani Shije\\'athra.',['C']=1.007000,['N']='Baandari Den',},[59]={['O']=19034,['D']='The Cove is only spoken about only in exclusive circles; this Speakeasy is a retreat hidden in plain sight, a private club to serve the elusive rogue Litani Shije\\'athra.',['C']=1.014000,['N']='The Cove',},[73]={['O']=19034,['D']='\"Whisker Elixir\" is here for all your alchemical and botanical needs!\\n \\nCome relax by one of our fountains, or ask one of our staff about your gardening projects!\\n----\\nW.E. is one of Litani Shije\\'athra\\'s outreach projects; after seeing the devastation of the Khahatan Flu, she was compelled to research whether or not the corrupting magics of Maarselok could be reversed and used to heal the land-- and the people. She considers this one way in which she can balance the shadows with a little light.',['C']=1.007000,['N']='Whisker Elixir(const',},[6]={['O']=19034,['D']='The office of Litani Shije\\'athra, in Deshaan.',['C']=1.007000,['N']='Deshaan Suite',},[69]={['O']=19034,['D']='Within these halls, the thinkings and theories of the rogueish Warden, Litani Shije\\'athra, come to life and connect her birthplace of Anequina with the celestial bodies above.',['C']=1.030000,['N']='Lunar Lab',},[63]={['O']=19034,['D']='What pieces of Yule memories I can cherish, I hide them here.',['C']=1.022000,['N']='Yule\\'s Hidden Light',},},}"
